INSERT INTO `catalogsearch_fulltext` VALUES ('166', '1', 'HTC Touch Diamond|Enabled|Black|HTC|HTC Touch Diamond|HTC Touch Diamond||Re-defining the perception of advanced mobile phones… the HTC Touch Diamond™ signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design.|Re-defining the perception of advanced mobile phones… the HTC Touch Diamond™ signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design. Featuring a sharp 2.8-inch touch screen housed within a stunning formation of brushed metal and flawless faceted edges, the HTC Touch Diamond is as beautiful to behold as it is to use. With HTC’s vibrant touch-responsive user interface, TouchFLO™ 3D, and ultra-fast HSDPA internet connectivity… the HTC Touch Diamond offers a rich online experience to rival a notebook computer, allowing you to interact with Google, YouTube, and Wikipedia as freely as you would with a broadband connection. Your contacts, favourite music, videos and photos are no longer an uninspired line of text. With TouchFLO 3D, album artwork, video stills and snapshots of your friends’ and family’s faces are brought to life for you to interact, play and launch at your fingertips. A 3.2 megapixel auto-focus camera will help you capture the perfect moment in style and with a massive 4GB of internal storage you can keep all the files you need. The integrated ultra-sensitive GPS will help you find your destination as quickly and efficiently as a dedicated satellite navigation unit. Style and substance in a phone are no longer mutually exclusive. The HTC Touch Diamond has arrived.|Re-defining the perception of advanced mobile phones… the HTC Touch Diamond™ signals a giant leap forward in combining hi-tech prowess with intuitive usability and exhilarating design. Featuring a sharp 2.8-inch touch screen housed within a stunning formation of brushed metal and flawless faceted edges, the HTC Touch Diamond is as beautiful to behold as it is to use. With HTC’s vibrant touch-responsive user interface, TouchFLO™ 3D, and ultra-fast HSDPA internet connectivity… the HTC Touch Diamond offers a rich online experience to rival a notebook computer, allowing you to interact with Google, YouTube, and Wikipedia as freely as you would with a broadband connection. Your contacts, favourite music, videos and photos are no longer an uninspired line of text. With TouchFLO 3D, album artwork, video stills and snapshots of your friends’ and family’s faces are brought to life for you to interact, play and launch at your fingertips. A 3.2 megapixel auto-focus camera will help you capture the perfect moment in style and with a massive 4GB of internal storage you can keep all the files you need. The integrated ultra-sensitive GPS will help you find your destination as quickly and efficiently as a dedicated satellite navigation unit. Style and substance in a phone are no longer mutually exclusive. The HTC Touch Diamond has arrived.|102 mm (L) X 51 mm (W) X 11.35 mm (T)|750|1', '61');
INSERT INTO `catalogsearch_fulltext` VALUES ('16', '3', 'n2610|Enabled|Black|Nokia 2610 Phone|2610|4.1 x 1.7 x 0.7 inches|The Nokia 2610 is an easy to use device that combines multiple messaging options including email, instant messaging, and more. You can even download MP3 ringtones, graphics, and games straight to the phone, or surf the Internet with Cingular\'s MEdia Net service. It\'s the perfect complement to Cingular service for those even remotely interested in mobile Web capabilities in an affordable handset. Design Compact and stylish, the 2610 features a candybar design sporting a bright 128 x 128 pixel display capable of displaying over 65,000 colors. Most of the phone\'s features and on-screen menus are controlled by a center toggle on the control pad. A standard hands-free headphone jack is provided, as are volume control keys, and there\'s even a \"Go-To\" button that can be assigned by the user for quick access to favorite applications. Lastly, the included speakerphone allows you to talk handsfree, and because the phone sports an internal antenna, there\'s nothing to snag or break off.|Integrated camera with video recorder to capture those special moments Enriched data connections for complete mobile access via Email, MMS, and MEdia Net Personalize with downloadable MP3 and polyphonic Ring tones, Games, and Graphics Use AIM, Yahoo! and MSN Messenger to stay in touch on the go Mobile Internet browser and email|Nokia 2610, cell, phone,|The words \"entry level\" no longer mean \"low-end,\" especially when it comes to the Nokia 2610. Offering advanced media and calling features without breaking the bank|149.99|1', '62');
INSERT INTO `catalogsearch_fulltext` VALUES ('17', '3', 'bb8100|Silver|Enabled|BlackBerry 8100 Pearl|8100|4.2 x 2 x 0.6 inches|Like the BlackBerry 7105t, the BlackBerry 8100 Pearl is The BlackBerry 8100 Pearl sports a large 240 x 260 screen that supports over 65,000 colors-- plenty of real estate to view your e-mails, Web browser content, messaging sessions, and attachments. The venerable BlackBerry trackwheel has been replaced on this model with an innovative four-way trackball placed below the screen. On the rear of the handheld, you\'ll find a 1.3-megapixel camera and a self portrait mirror. The handheld\'s microSD memory card slot is located inside the device, behind the battery. There\'s also a standard 2.5mm headset jack that can be used with the included headset, as well as a mini-USB port for data connectivity.|1.3 mega pixel camera to capture those special moments MP3 player lets you listen to your favorite music on the go Menu and escape keys on the front of the device for easier access Bluetooth technology lets you experience hands free and wire free features Package Contents: phone,AC adapter,software CD,headset,USB cable,sim- card,get started poster,reference guide|Blackberry, 8100, pearl, cell, phone|The BlackBerry 8100 Pearl is a departure from the form factor of previous BlackBerry devices. This BlackBerry handset is far more phone-like, and RIM\'s engineers have managed to fit a QWERTY keyboard onto the handset\'s slim frame.|349.99|1', '63');
INSERT INTO `catalogsearch_fulltext` VALUES ('18', '3', 'sw810i|Black|Enabled|Sony Ericsson W810i|W810i|3.5 x 1.8 x 1 inches|The W810i\'s screen sports 176 x 220 pixel resolution with support for 262,000 colors. Quick access buttons below the screen make it easy to control the phone\'s Walkman music features, while a five-way center button controls most of the phone\'s menus and features.|Disc2Phone™ music copying software is supplied in the W810 kit and it’s easy to copy songs from your favorite CDs, and PC music folders The built-in W810 2 megapixel digital camera with autofus takes excellent photos and when you need to catch some action, W810 has video too Sharing images and other phone content is easy. Use Bluetooth™, or Multimedia messaging when you want to send images and video Wherever you are, you have high speed access to the internet with EDGE technology A full-function email client in your W810 gives you access to your inbox wherever you go|Sony, Ericsson ,W810i, cell, phone|The W810i follows a long tradition of beautifully designed and crafted phones from Sony Ericsson. The same candy-bar style that graced the W800 is here.|399.99|1', '64');
INSERT INTO `catalogsearch_fulltext` VALUES ('19', '3', '8525PDA|Silver|Enabled|AT&T 8525 PDA|8525 PDA|4.4 x 2.4 x 0.9 inches|The design of the 8525 is clean and uncluttered, with just a few buttons for mail, Internet Explorer, and contextual menus. Meanwhile, call answer and end buttons surround a five-way toggle that allows you to navigate and control the Windows Mobile interface. As mentioned, a full QWERTY keyboard cleverly slides out from underneath the screen. This allows you to hold the device horizontally, and the screen is automatically placed in landscape mode when you\'re using the keyboard. A side scroll wheel is conveniently tucked away on the side, making navigation when accessing the music player and other various applications a cinch when needed. A mini-SD memory expansion card slot is provided, as is an infrared port and support for a stereo Bluetooth headset. A mini-USB port is also included for wired data transfers and charging.|tri-band UMTS/HSDPA; quad-band GSM/GPRS/EDGE for global use Windows Mobile 5.0 with Messaging & Security Feature Pack sliding QWERTY keyboard with improved keypad design and improved backlight for easier use in low light conditions 128MB ROM / 64MB RAM; ~51MB user available memory 2.0 mega-pixel camera with video capabilities|At&t, 8525, cell, phone|Under the hood, the 8525 features 128MB of embedded memory and 64MB RAM, running on a 400 MHz Samsung processor. Up front, the 240 x 320 LCD touch-screen supports over 65,000 colors, while the rear of the device houses a 2.0 megapixel camera.|199.99|1', '65');
INSERT INTO `catalogsearch_fulltext` VALUES ('20', '3', 'MM-A900M|Silver|Enabled|Samsung MM-A900M Ace|MM-A900M|3.9 x 2 x 0.6 inches|New services supported by both the MM-A900m include the newly announced Sprint Music StoreSM, which allows users to immediately buy and download complete songs directly to their phone; 30 channels of live and on demand video and audio from Sprint TVSM and On Demand, a personalized resource guide to news, traffic, weather, sports and entertainment. The MM-A900m offers great-looking design with the ability to download a rich selection of content directly to the phone. Features like external music-navigation keys make these phones both functional and attractive. These handsets are sure to be at the top of many wish lists.|Bluetooth Wireless Technology: Built-in radio technology allows fast, secure transmission between your phone and accessories without cables or wires. Bluetooth wireless accessories are sold separately. Mass Storage Area: Store pictures, videos, voice memos and music within the internal memory of the phone. Streaming Music Enabled: Stream music to your phone with Music Choice®. Select from Pop, Rock, Hip Hop, and R&B plus exclusive video clips, performances, and artist interviews.|Samsung, MM-A900M, cell, phone|The MM-A900m offers great-looking design with the ability to download a rich selection of content directly to the phone.|150|1', '66');
INSERT INTO `catalogsearch_fulltext` VALUES ('25', '3', 'MA464LL/A|Silver|Enabled|Apple|Apple MacBook Pro MA464LL/A 15.4\" Notebook PC|MA464LL/A|19.5 x 7.6 x 19.5 inches|2.0 GHz Intel Core Duo processor with 2 MB shared L2 Cache|1 GB (single SODIMM) 667 MHz DDR2 SDRAM (PC2-5300)|100 GB 5400 rpm Serial ATA hard drive|15.4-inch TFT widescreen display with 1440 x 900 resolution|This, combined with myriad other engineering leaps, boosts performance up to four times higher than the PowerBook G4. With this awesome power, it\'s a breeze to render complex 3D models, enjoy smooth playback of HD video, or host a four-way video conference.Intel Core Duo is the first chip built using Intel\'s groundbreaking 65-nanometer process - resulting in transistors so small, you could fit a hundred inside a single human cell. With smaller distances for electrons to travel, and two processors designed to share resources and conserve power, Intel Core Duo achieves higher levels of performance as it uses fewer watts. Which is what makes it possible to design a super-powerful MacBook Pro that\'s only one inch thin.When Mac technology makes something easy, it\'s hardly news. So here\'s more non-news for MacBook Pro owners: software just works. If you see the Universal logo on a new application, that means it will run on Intel- and PowerPC-based Mac computers. For most existing applications, you simply do what you\'ve always done: double-click them. Thanks to the Rosetta technology in Mac OS X, they look and feel just like they did before.|2.0 GHz Intel Core Duo processor with 2 MB shared L2 Cache 1 GB (single SODIMM) 667 MHz DDR2 SDRAM (PC2-5300); 100 GB 5400 rpm Serial ATA hard drive; slot-load SuperDrive (DVD±RW/CD-RW) One FireWire 400, two USB 2.0 ports, and ExpressCard/34 slot; no FireWire 800 slots Built-in 10/100/1000BASE-T (Gigabit); built-in 54 Mbps AirPort Extreme (802.11g); built-in Bluetooth 2.0+EDR 15.4-inch TFT widescreen display with 1440 x 900 resolution|Apple MacBook Pro MA464LL/A 15.4\" Notebook PC (2.0 GHz Intel Core Duo, 1 GB RAM, 100 GB Hard Drive, SuperDrive)|You\'ve seen improvements in notebook performance before - but never on this scale. The Intel Core Duo powering MacBook Pro is actually two processors built into a single chip.|2299.99|1', '67');
