INSERT INTO `catalogsearch_fulltext` VALUES ('44', '3', 'Rebel XT|Black|8|Enabled|Canon Digital Rebel XT 8MP Digital SLR Camera|8.0-megapixel CMOS sensor captures enough detail for photo-quality 16 x 22-inch prints Includes Canon\'s EF-S 18-55mm, f3.5-5.6 zoom lens DIGIC II Image Processor provides fast, accurate image processing; captures images at a rate of up to 3 frames per second Fast start-up time--.2 seconds Powered by rechargeable Lithium-ion battery (included, with charger)|canon, slr, camera, 8, digital|Canon EOS Digital Rebel XT SLR adds resolution, speed, extra creative control, and enhanced comfort in the hand to one of the smallest and lightest digital cameras in its class.|Rebel XT|5 x 3.7 x 2.5 inches|The Canon EOS Digital Rebel camera now has a new, faster, even smaller big brother. Sibling rivalries aside, the 8.0-megapixel Canon EOS Digital Rebel XT SLR adds resolution, speed, extra creative control, and enhanced comfort in the hand to one of the smallest and lightest digital cameras in its class. Even with its advancements in ergonomic design and technology, this easy-to-use EOS digital camera is compatible with all of Canon\'s EF lenses, including the EF-S lenses.|550|1', '74');
INSERT INTO `catalogsearch_fulltext` VALUES ('45', '3', 'QC-2185|Silver|5|Enabled|Argus QC-2185 Quick Click 5MP Digital Camera|QC-2185|2.75 inches x 1.5 inches|The Argus QC-2185 Quick Click 5MP digital camera offers all the basic features you need in a compact and stylish digital camera. This unit is easy to use, and is perfect for those who want a completely portable option for taking good pictures, without having to empty their wallet. The Argus QC-2185 features a clear and bright 1.1-inch CSTN (color super-twist nematic) LCD display that makes it easy to frame the perfect picture. Thanks to its USB 1.1 connection compatibility, this digital camera lets you quickly download pictures to your Mac or PC, and can also function as a handy web camera. The QC-2185 includes eight megabytes of internal SDRAM memory, with the ability to expand camera memory via a built-in SD (secure digital) storage card slot for easy storage and transfer of your pictures. This unit also includes a built-in auto flash with a three to seven foot range, and comes with ArcSoft PhotoImpression\'s photo editing software which makes it easy for you to edit, crop, adjust and improve all your best pictures to make them even better.||Argus, QC-2185, digital, camera, 2MP|The Argus QC-2185 Quick Click 5MP digital camera offers all the basic features you need in a compact and stylish digital camera. This unit is easy to use, and is perfect for those who want a completely portable option for taking good pictures, without having to empty their wallet.|37.49|1', '75');
INSERT INTO `catalogsearch_fulltext` VALUES ('46', '3', '750|Silver|7|Enabled|Olympus Stylus 750 7.1MP Digital Camera|750|3.8 x 2.1 x 1 inches|Olympus continues to innovate with the launch of the Stylus 750 digital camera, a technically sophisticated point-and-shoot camera offering a number of pioneering technologies such as Dual Image Stabilization, Bright Capture Technology, and TruePic Turbo, as well as a powerful 5x optical zoom that tucks away into a streamlined metal, all-weather body design. The camera is distinguished by a number of premium features, including: * An advanced combination of the mechanical CCD-shift Image Stabilization and Digital Image Stabilization work together to ensure the clearest pictures possible in any situation; * A 5x optical zoom lens with a newly developed lens element to maintain a small compact size; * A 2.5-inch LCD and Bright Capture Technology dramatically improve composition, capture and review of images in low-light situations; * Olympus\' exclusive TruePic Turbo Image Processing engine is coupled with a 7.1-megapixel image sensor to produce crisp, high-quality p|7.1-megapixel CCD captures enough detail for photo-quality 15 x 20-inch prints 5x image-stabilized optical zoom; 2.5-inch LCD display Compact, all-weather body measures 3.8 x 2.1 x 0.96 inches Bright Capture technology; 27 selectable shooting modes; built-in Help guide Stores images on xD Picture Cards; powered by Li-Ion battery (battery and charger included)|Olympus, stylus, 750, 7MP, digital, camera, zoom|A technically sophisticated point-and-shoot camera offering a number of pioneering technologies such as Dual Image Stabilization, Bright Capture Technology, and TruePic Turbo, as well as a powerful 5x optical zoom.|161.94|1', '76');
