INSERT INTO `catalogsearch_fulltext` VALUES ('44', '2', 'Rebel XT|Black|8|Enabled|Canon Digital Rebel XT 8MP Digital SLR Camera|8.0-megapixel CMOS sensor captures enough detail for photo-quality 16 x 22-inch prints Includes Canon\'s EF-S 18-55mm, f3.5-5.6 zoom lens DIGIC II Image Processor provides fast, accurate image processing; captures images at a rate of up to 3 frames per second Fast start-up time--.2 seconds Powered by rechargeable Lithium-ion battery (included, with charger)|canon, slr, camera, 8, digital|Canon EOS Digital Rebel XT SLR adds resolution, speed, extra creative control, and enhanced comfort in the hand to one of the smallest and lightest digital cameras in its class.|Rebel XT|5 x 3.7 x 2.5 inches|The Canon EOS Digital Rebel camera now has a new, faster, even smaller big brother. Sibling rivalries aside, the 8.0-megapixel Canon EOS Digital Rebel XT SLR adds resolution, speed, extra creative control, and enhanced comfort in the hand to one of the smallest and lightest digital cameras in its class. Even with its advancements in ergonomic design and technology, this easy-to-use EOS digital camera is compatible with all of Canon\'s EF lenses, including the EF-S lenses.|550|1', '135');
INSERT INTO `catalogsearch_fulltext` VALUES ('45', '2', 'QC-2185|Silver|5|Enabled|Argus QC-2185 Quick Click 5MP Digital Camera|QC-2185|2.75 inches x 1.5 inches|The Argus QC-2185 Quick Click 5MP digital camera offers all the basic features you need in a compact and stylish digital camera. This unit is easy to use, and is perfect for those who want a completely portable option for taking good pictures, without having to empty their wallet. The Argus QC-2185 features a clear and bright 1.1-inch CSTN (color super-twist nematic) LCD display that makes it easy to frame the perfect picture. Thanks to its USB 1.1 connection compatibility, this digital camera lets you quickly download pictures to your Mac or PC, and can also function as a handy web camera. The QC-2185 includes eight megabytes of internal SDRAM memory, with the ability to expand camera memory via a built-in SD (secure digital) storage card slot for easy storage and transfer of your pictures. This unit also includes a built-in auto flash with a three to seven foot range, and comes with ArcSoft PhotoImpression\'s photo editing software which makes it easy for you to edit, crop, adjust and improve all your best pictures to make them even better.||Argus, QC-2185, digital, camera, 2MP|The Argus QC-2185 Quick Click 5MP digital camera offers all the basic features you need in a compact and stylish digital camera. This unit is easy to use, and is perfect for those who want a completely portable option for taking good pictures, without having to empty their wallet.|37.49|1', '136');
