INSERT INTO `catalogsearch_fulltext` VALUES ('138', '2', 'apevia-black|Enabled|Black|Apevia Black X-Cruiser Case ATX Mid-Tower Case (Default)||This superb, multi-functional Aspire X-Cruiser mid tower case is designed to follow Intel\'s recommendations to achieve the highest level of thermal performance. This gorgeous case outperforms most of the expensive chassis in the market, boasts an abundance of innovative features, yet carries a very affordable price tag. The Aspire X-Cruiser is fully loaded with everything you could possibly imagine that a great gaming case could have. With a built-in air duct on the side panel to funnel cool air towards the CPU, the fan-less X-Cruiser is specially designed to bring out the best performance in systems based on high-end processors.|This magnificent new case features 2 x 80mm built-in fans with space for 2 optional fans. The Aspire X-Cruiser features front temperature gauge, front fan speed controller and gauge, and front volume controller and gauge. It also features USB2.0, Firewire and audio ports. The superior cooling solution that X-Cruiser delivers can only be found in very few of the expensive chassis in the market.|150|1', '158');
INSERT INTO `catalogsearch_fulltext` VALUES ('139', '2', 'nzxtlexa|Silver|Enabled|NZXT Lexa Silver Aluminum ATX Mid-Tower Case (Default)||Introducing the next advancement in case design and technology, the Lexa. Designed from ground up to be symmetrical, the Lexa is representative of the modern lifestyle design cues of today. The Lexa\'s minimalist and classy design fits perfectly under the NZXT Classic Series line.|The Lexa boasts a ridgid, but light weight aluminum chassis. The Lexa\'s high-air-flow design, while quiet, ensures cooling options for the more ambitious computing enthusiasts. Three thermal probes provide temperature readings to the illuminated LCD display for monitoring your systems core components. The Lexa ships with a rugged carrying strap with protective window cover for easy single-handed transportation.|199.99|1', '159');
