INSERT INTO `catalog_product_entity_text` VALUES ('67', '10', '97', '0', '32', 'The Lucero pump from Nine West may just leave him at a loss for words. This flirty pump has a leather upper, a pretty almond-shaped toe with a slight V-cut vamp, leather linings, and a cushioned insole for long-wearing comfort. The stiletto heel radiates a subtle hint of sensuality, so sass up your jean and t-shirt look or nighttime attire with this hot pump and you\'ll be absolutely unforgettable.');
INSERT INTO `catalog_product_entity_text` VALUES ('68', '10', '492', '0', '32', 'The perfect pump will suit any ensemble. Leather upper. 3-3/4 inch stacked heel. Man-made sole. Imported. ');
