INSERT INTO `catalog_product_entity_text` VALUES ('411', '10', '97', '0', '157', '    * Digital (DVI), USB 2.0 and FireWire 400 inputs\r\n    * Cinema HD delivers up to 16.7 million colors across a wide gamut for a breathtaking, vivid picture\r\n    * ColorSync technology lets you create a custom profile to maintain consistent colors on the screen and in print\r\n    * Single cable with breakout for DVI, USB and FireWire ports provides a tidy look while reducing clutter\r\n    * Built-in, 2-port USB 2.0 hub to easily connect peripheral devices\r\n    * User controls allow you to monitor display power, system sleep/wake, brightness and monitor tilt\r\n    * Antiglare, hard-coat screen treatment\r\n    * Wall-mountable with optional mounting kit (not included)\r\n    * ENERGY STAR compliance assures a high standard of energy efficiency\r\n');
INSERT INTO `catalog_product_entity_text` VALUES ('412', '10', '506', '0', '157', 'Computer games, digital photo editing and graphic applications will astound you on this huge 30\" flat-panel monitor. Cinema HD and ColorSync technology let you enjoy 16.7 million breathtaking colors and custom profiling for color consistency.');
INSERT INTO `catalog_product_entity_text` VALUES ('413', '10', '97', '0', '158', ' <ul>\r\n<ul class=\"disc\">\r\n<li>Processor: The Ultra Low Voltage Intel Core Solo U1500 processor offers a 1.33 GHz speed paired with a fast 533 MHz front-side bus and large 2 MB L2 cache. (An L2, or secondary, cache temporarily stores data; and a larger L2 cache can help speed up your system\'s performance. The FSB carries data between the CPU and RAM, and a faster front-side bus will deliver better overall performance.) The Core Solo processor delivers enhanced performance for today\'s demanding applications such as CAD tools, 3-D and 2-D modeling, video editing, digital music, digital photography and gaming. And Intel\'s Smart Cache technology enables smarter, more efficient cache and bus design for enhanced performance, responsiveness and power savings.</li>\r\n</ul>\r\n');
INSERT INTO `catalog_product_entity_text` VALUES ('414', '10', '97', '0', '159', 'The most comfortable ergonomic keyboard on the market! We just made a great deal for this Microsoft Natural ergonomic keyboard. And we know you’re going to love it. This newest addition to the world’s best selling line of ergonomic keyboards features a natural wrist alignment that will make your day! Just one touch allows you to perform a wealth of common but important tasks such as opening documents and replying to e-mail. The Microsoft Natural Model 4000 ergonomic keyboard also features an improved number pad with easy-to-reach symbols such left and right, equal sign and back space placed just above the number pad. Easy-access to the Internet. Multimedia keys. Lockable F keys and much more (see complete list of additional features below). Don’t you think it’s time to go natural? Microsoft’s Natural Ergonomic Model 4000 Keyboard. Available right here, for the best price!');
INSERT INTO `catalog_product_entity_text` VALUES ('415', '10', '506', '0', '159', 'The most comfortable ergonomic keyboard on the market! We just made a great deal for this Microsoft Natural ergonomic keyboard.');
