INSERT INTO `catalog_product_entity_text` VALUES ('531', '10', '97', '0', '31', 'Nothing will turn his head faster than you wearing the sexy Pryme pump from Steven by Steve Madden. This daring pump has a pretty patent leather upper with light shirring, a double stitch detail surrounding the collar, and a vampy almond shaped toe. It also features smooth linings, a fully cushioned insole, a sexy covered stiletto heel, and a lightly textured dress leather outsole. Any way you wear the Pryme, you\'re certain to catch a lot of attention.');
INSERT INTO `catalog_product_entity_text` VALUES ('532', '10', '492', '0', '31', 'A prime example of chic style. Patent leather upper. Round toe. 3-1/2 inch covered heel. Flex leather sole. Imported. ');
INSERT INTO `catalog_product_entity_text` VALUES ('533', '10', '104', '0', '31', 'Steven by Steve Madden Pryme Pump');
INSERT INTO `catalog_product_entity_text` VALUES ('534', '10', '492', '0', '33', 'Featuring a wide toe box and delivering optimum support, the sporty Golf Flexor golf shoe is a stylish cleat that you\'ll love wearing on and off the links. The contrasting embossed snakeskin panels attract interest, while the laid back lace-up style keeps things simple. And thanks to the one-year waterproof guarantee, you can trust these shoes to keep you in the game, even when conditions are less than perfect.');
INSERT INTO `catalog_product_entity_text` VALUES ('535', '10', '104', '0', '33', 'ECCO Womens Golf Flexor Golf Shoe');
INSERT INTO `catalog_product_entity_text` VALUES ('536', '10', '495', '0', '34', 'B000IKC6AY');
INSERT INTO `catalog_product_entity_text` VALUES ('537', '10', '97', '0', '34', 'High fashion and classic good looks converge in this suave slip on from Kenneth Cole. Smooth leather upper in a dress slip on style, with a stitched and covered seam moc-inspired square toe, quarter panel curved overlays and flared tongue with side elastic panels for a comfortable, secure fit. Smooth leather lining, cushioned leather topped insole. Dress midsole with a beveled edge, 1 inch capped dress heel. Flat traction outsole.');
INSERT INTO `catalog_product_entity_text` VALUES ('538', '10', '492', '0', '34', 'The handsome style of the Con-Verge slip-on from Kenneth Cole New York is larger than life. This sharp shoe has a semi-polished smooth leather upper, a squared off stitched apron toe, and dual-goring for easy on/off accessibility. It also features soft leather linings, a cushioned insole, and a paneled rubber outsole for a sturdy step. The Con-Verge is a perfect companion to your business and special occasion wardrobes.');
INSERT INTO `catalog_product_entity_text` VALUES ('539', '10', '104', '0', '34', 'Kenneth Cole New York Men\'s Con-verge Slip-on');
