INSERT INTO `catalog_product_entity_text` VALUES ('556', '10', '506', '0', '28', 'Get the competitive edge with the Gateway M285-E. This widescreen Convertible Notebook functions as both a conventional notebook and a tablet.');
INSERT INTO `catalog_product_entity_text` VALUES ('557', '10', '506', '0', '27', 'Take a load off your shoulders when you\'re racing for your plane with the sleekly designed and ultra-portable Sony Vaio VGN-TXN27N/B notebook PC.');
INSERT INTO `catalog_product_entity_text` VALUES ('558', '10', '506', '0', '26', 'This exclusive edition is another striking symbol of cooperation between Acer and Ferrari -- two progressive companies with proud heritages built on passion, innovation, power and success');
INSERT INTO `catalog_product_entity_text` VALUES ('559', '10', '506', '0', '25', 'You\'ve seen improvements in notebook performance before - but never on this scale. The Intel Core Duo powering MacBook Pro is actually two processors built into a single chip.');
INSERT INTO `catalog_product_entity_text` VALUES ('560', '10', '506', '0', '20', 'The MM-A900m offers great-looking design with the ability to download a rich selection of content directly to the phone. ');
INSERT INTO `catalog_product_entity_text` VALUES ('561', '10', '506', '0', '45', 'The Argus QC-2185 Quick Click 5MP digital camera offers all the basic features you need in a compact and stylish digital camera. This unit is easy to use, and is perfect for those who want a completely portable option for taking good pictures, without having to empty their wallet.');
INSERT INTO `catalog_product_entity_text` VALUES ('562', '10', '506', '0', '46', 'A technically sophisticated point-and-shoot camera offering a number of pioneering technologies such as Dual Image Stabilization, Bright Capture Technology, and TruePic Turbo, as well as a powerful 5x optical zoom.');
