g when you want to send images and video<br></li>\r\n<li> Wherever you are, you have high speed access to the internet with EDGE technology<br></li>\r\n<li> A full-function email client in your W810 gives you access to your inbox wherever you go</li>\r\n</ul>', null, null, null, null, null, null, null, null, null, null, null, 'The W810i follows a long tradition of beautifully designed and crafted phones from Sony Ericsson. The same candy-bar style that graced the W800 is here, as is the horizontally-oriented camera unit on the back of the phone, allowing you to hold the phone j', 'Sony, Ericsson ,W810i, cell, phone', 'Sony Ericsson W810i', '399.9900', 'W810i', null, null, null, 'Sony Ericsson W810i', null, null, null, '399.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'The W810i follows a long tradition of beautifully designed and crafted phones from Sony Ericsson. The same candy-bar style that graced the W800 is here.', 'sw810i', null, '/s/o/sony-ericsson-w810i-2.jpg', null, null, null, null, '2', '/s/o/sony-ericsson-w810i-2.jpg', null, '2008-08-08 14:50:56', 'sony-ericsson-w810i', null, '4', '13.6000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('19', '38', 'simple', 'Conditional $250 Equipment Discount Included: Your price paid includes an equipment discount of $250 that has been provided to you in exchange for either activating a new, non-substitute line of service or renewing an existing line of service with AT&T and your agreement that for the 181-day period following such activation or renewal you will: (1) pay your balance due to AT&T each month and otherwise maintain your account in good standing; (2) not disconnect this AT&T line of service; (3) not transfer this equipment to another AT&T line of service; (4) not change your AT&T service rate plan to a lower monthly service rate--this includes canceling or removing required PDA, BlackBerry, or smartphone features after your product has shipped; (5) not use this line of service to replace an existing account with AT&T. If these conditions are not met, you hereby authorize Magento.com to charge your credit card $250 as reimbursement of this equipment discount without need for further approval.', '23', 'Silver', null, null, null, null, '29.9900', null, null, null, '2007-08-23 15:55:29', null, null, '', ' The design of the 8525 is clean and uncluttered, with just a few buttons for mail, Internet Explorer, and contextual menus. Meanwhile, call answer and end buttons surround a five-way toggle that allows you to navigate and control the Windows Mobile interface. As mentioned, a full QWERTY keyboard cleverly slides out from underneath the screen. This allows you to hold the device horizontally, and the screen is automatically placed in landscape mode when you\'re using the keyboard. A side scroll wheel is conveniently tucked away on the side, making navigation when accessing the music player and other various applications a cinch when needed. A mini-SD memory expansion card slot is provided, as is an infrared port and support for a stereo Bluetooth headset. A mini-USB port is also included for wired data transfers and charging.', '4.4 x 2.4 x 0.9 inches', null, null, null, null, null, '0', null, null, '0', '/a/t/at-t-8525-pda-1.jpg', null, '<ul>\r\n<ul class=\"disc\">\r\n<li>tri-band UMTS/HSDPA; quad-band GSM/GPRS/EDGE for global use<br></li>\r\n<li>Windows Mobile 5.0 with Messaging & Security Feature Pack<br></li>\r\n<li>sliding QWERTY keyboard with improved keypad design and improved backlight for easier use in low light conditions<br></li>\r\n<li>128MB ROM / 64MB RAM; ~51MB user available memory<br></li>\r\n<li>2.0 mega-pixel camera with video capabilities</li>\r\n</ul>', null, null, null, null, null, null, null, null, null, null, null, 'nder the hood, the 8525 features 128MB of embedded memory and 64MB RAM, running on a 400 MHz Samsung processor. Up front, the 240 x 320 LCD touch-screen supports over 65,000 colors, while the rear of the device houses a 2.0 megapixel camera. The design of', 'At&t, 8525, cell, phone', 'AT&T 8525 PDA Phone', '199.9900', '8525 PDA', null, null, null, 'AT&T 8525 PDA', null, null, null, '199.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'Under the hood, the 8525 features 128MB of embedded memory and 64MB RAM, running on a 400 MHz Samsung processor. Up front, the 240 x 320 LCD touch-screen supports over 65,000 colors, while the rear of the device houses a 2.0 megapixel camera.', '8525PDA', null, '/a/t/at-t-8525-pda-1.jpg', null, null, null, null, '2', '/a/t/at-t-8525-pda-1.jpg', null, '2008-08-08 14:51:11', 'atandt-8525-pda', null, '4', '30.0000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('20', '38', 'simple', 'CONDITIONAL $250 Equipment Discount Included: Your price paid includes an equipment discount of $250 that has been provided to you in exchange for activating a new, non-substitute line of service with Sprint and your agreement that for the 181-day period following such activation you will (1) pay your balance due to Sprint each month and otherwise maintain your account in good standing, (2) not disconnect this Sprint line of service, (3) not transfer this equipment to another Sprint line of service, (4) not change your Sprint service rate plan to a lower monthly service rate--this includes canceling or removing required PDA, BlackBerry, or smartphone features after your product has shipped, and (5) not use this line of service to replace an existing account with Sprint. If these conditions are not met, you hereby authorize Magento.com to charge your credit card $250 as reimbursement of this equipment discount without need for further approval.', '23', 'Silver', null, null, null, null, '29.9900', null, null, null, '2007-08-23 18:06:42', null, null, '', 'New services supported by both the MM-A900m include the newly announced Sprint Music StoreSM, which allows users to immediately buy and download complete songs directly to their phone; 30 channels of live and on demand video and audio from Sprint TVSM and On Demand, a personalized resource guide to news, traffic, weather, sports and entertainment. The MM-A900m offers great-looking design with the ability to download a rich selection of content directly to the phone. Features like external music-navigation keys make these phones both functional and attractive. These handsets are sure to be at the top of many wish lists.', '3.9 x 2 x 0.6 inches', null, null, null, null, null, '0', null, null, '0', '/s/a/samsung-mm-a900m-ace.jpg', null, '<ul>\r\n<ul class=\"disc\">\r\n<li>Bluetooth Wireless Technology: Built-in radio technology allows fast, secure transmission between your phone and accessories without cables or wires. Bluetooth wireless accessories are sold separately.<br></li>\r\n<li>Mass Storage Area: Store pictures, videos, voice memos and music within the internal memory of the phone.<br></li>\r\n<li>Streaming Music Enabled: Stream music to your phone with Music Choice®. Select from Pop, Rock, Hip Hop, and R&B plus exclusive video clips, performances, and artist interviews.<br></li>\r\n</ul>\r\n   ', null, null, null, null, null, null, null, null, null, null, null, 'New services supported by both the MM-A900m include the newly announced Sprint Music StoreSM, which allows users to immediately buy and download complete songs directly to their phone', 'Samsung, MM-A900M, cell, phone', 'Samsung MM-A900M Ace Phone', '150.0000', 'MM-A900M', null, null, null, 'Samsung MM-A900M Ace', null, null, null, '150.0000', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'The MM-A900m offers great-looking design with the ability to download a rich selection of content directly to the phone. ', 'MM-A900M', null, '/s/a/samsung-mm-a900m-ace.jpg', null, null, null, null, '2', '/s/a/samsung-mm-a900m-ace.jpg', null, '2008-08-08 14:51:27', 'samsung-mm-a900m-ace', null, '4', '1.0000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('25', '39', 'simple', null, '23', 'Silver', '77', 'Apple', null, null, '1299.9900', null, null, null, '2007-08-24 14:28:50', null, null, '', 'This, combined with myriad other engineering leaps, boosts performance up to four times higher than the PowerBook G4. With this awesome power, it\'s a breeze to render complex 3D models, enjoy smooth playback of HD video, or host a four-way video conference.Intel Core Duo is the first chip built using Intel\'s groundbreaking 65-nanometer process - resulting in transistors so small, you could fit a hundred inside a single human cell. With smaller distances for electrons to travel, and two processors designed to share resources and conserve power, Intel Core Duo achieves higher levels of performance as it uses fewer watts. Which is what makes it possible to design a super-powerful MacBook Pro that\'s only one inch thin.When Mac technology makes something easy, it\'s hardly news. So here\'s more non-news for MacBook Pro owners: software just works. If you see the Universal logo on a new application, that means it will run on Intel- and PowerPC-based Mac computers. For most existing applications, you simply do what you\'ve always done: double-click them. Thanks to the Rosetta technology in Mac OS X, they look and feel just like they did before.', '19.5 x 7.6 x 19.5 inches', null, null, null, null, null, '0', null, '100 GB 5400 rpm Serial ATA hard drive', '1', '/a/p/apple-macbook-pro-ma464ll-a-15-4-notebook-pc.jpg', null, ' <ul>\r\n<ul class=\"disc\">\r\n<li>2.0 GHz Intel Core Duo processor with 2 MB shared L2 Cache<br></li>\r\n<li>1 GB (single SODIMM) 667 MHz DDR2 SDRAM (PC2-5300); 100 GB 5400 rpm Serial ATA hard drive; slot-load SuperDrive (DVD±RW/CD-RW)<br></li>\r\n<li>One FireWire 400, two USB 2.0 ports, and ExpressCard/34 slot; no FireWire 800 slots<br></li>\r\n<li>Built-in 10/100/1000BASE-T (Gigabit); built-in 54 Mbps AirPort Extreme (802.11g); built-in Bluetooth 2.0+EDR<br></li>\r\n<li>15.4-inch TFT widescreen display with 1440 x 900 resolution</li>', null, null, null, null, null, null, null, null, null, null, '1 GB (single SODIMM) 667 MHz DDR2 SDRAM (PC2-5300)', 'Apple MacBook Pro MA464LL/A 15.4\" Notebook PC (2.0 GHz Intel Core Duo, 1 GB RAM, 100 GB Hard Drive, SuperDrive)', 'Apple MacBook Pro MA464LL/A 15.4\" Notebook PC (2.0 GHz Intel Core Duo, 1 GB RAM, 100 GB Hard Drive, SuperDrive) ', 'Apple MacBook Pro MA464LL/A 15.4\" Notebook PC (2.0 GHz Intel Core Duo, 1 GB RAM, 100 GB Hard Drive, SuperDrive)', '2299.9900', 'MA464LL/A', null, null, null, 'Apple MacBook Pro MA464LL/A 15.4\" Notebook PC', null, null, null, '2299.9900', null, null, '2.0 GHz Intel Core Duo processor with 2 MB shared L2 Cache', null, null, '0', null, null, null, null, '15.4-inch TFT widescreen display with 1440 x 900 resolution', null, null, null, null, null, null, null, null, 'You\'ve seen improvements in notebook performance before - but never on this scale. The Intel Core Duo powering MacBook Pro is actually two processors built into a single chip.', 'MA464LL/A', null, '/a/p/apple-macbook-pro-ma464ll-a-15-4-notebook-pc.jpg', null, null, null, null, '2', '/a/p/apple-macbook-pro-ma464ll-a-15-4-notebook-pc.jpg', null, '2008-07-28 21:27:34', 'apple-macbook-pro-ma464ll-a-15-4-notebook-pc-2-0-ghz-intel-core-duo-1-gb-ram-100-gb-hard-drive-superdrive', null, '4', '10.6000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('26', '39', 'simple', null, '24', 'Black', '79', 'Acer', null, null, '999.9900', null, null, null, '2007-08-24 14:35:16', null, null, '', ' Acer has flawlessly designed the Ferrari 3200, instilling it with exceptional performance, brilliant graphics, and lightning-fast connectivity. This exclusive edition is another striking symbol of cooperation between Acer and Ferrari -- two progressive companies with proud heritages built on passion, innovation, power and success.', '', null, null, null, null, null, '0', null, '80 gig Western Digital', '1', '/a/c/acer-ferrari-3200-notebook-computer-pc.jpg', null, ' <ul>\r\n<ul class=\"disc\">\r\n<li>Mobile AMD Athlon 64 2800+<br></li>\r\n<li>1MB L2 Cache<br></li>\r\n<li>512MB of PC2700 DDR333 SDRAM<br></li>\r\n<li>2 RAM Slots (0 open - upgrading requires chip removal)<br></li>\r\n<li>RAM is upgradeable to 2GB</li>\r\n</ul>', null, null, null, null, null, null, null, null, null, null, '512MB of PC2700 DDR333 SDRAM', 'Acer Ferrari 3200 Notebook Computer PC', 'Acer Ferrari 3200 Notebook Computer PC ', 'Acer Ferrari 3200 Notebook Computer PC', '1799.9900', 'LX.FR206.001', null, null, null, 'Acer Ferrari 3200 Notebook Computer PC', null, null, null, '1799.9900', null, null, 'Mobile AMD Athlon 64 2800+', null, null, '0', null, null, null, null, '15-inch, 200-nit, high-brightness TFT LCD screen ', null, null, null, null, null, null, null, null, 'This exclusive edition is another striking symbol of cooperation between Acer and Ferrari -- two progressive companies with proud heritages built on passion, innovation, power and success', 'LX.FR206.001', null, '/a/c/acer-ferrari-3200-notebook-computer-pc.jpg', null, null, null, null, '2', '/a/c/acer-ferrari-3200-notebook-computer-pc.jpg', null, '2008-08-05 07:14:52', 'acer-ferrari-3200-notebook-computer-pc', null, '4', '11.4000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('27', '39', 'simple', null, '24', 'Black', '76', 'Sony', null, null, '899.9900', null, null, null, '2007-08-24 14:41:56', null, null, '', ' Weighing in at just an amazing 2.84 pounds and offering a sleek, durable carbon-fiber case in charcoal black. And with 4 to 10 hours of standard battery life, it has the stamina to power you through your most demanding applications. With the integrated wireless WAN, you can access the national Sprint Mobile Broadband service to extend your wireless coverage beyond LAN access networks and hotspots, giving you the freedom to go farther, do more, and stay connected.\r\n\r\n', '10.7 x 1.23 x 7.7 inches (WxHxD)', null, null, null, null, null, '0', null, '100 GB Hard Drive', '0', '/s/o/sony-vaio-vgn-txn27n-b-11-1-notebook-pc.jpg', null, ' <ul>\r\n<ul class=\"disc\">\r\n<li>Processor: The Ultra Low Voltage Intel Core Solo U1500 processor offers a 1.33 GHz speed paired with a fast 533 MHz front-side bus and large 2 MB L2 cache. (An L2, or secondary, cache temporarily stores data; and a larger L2 cache can help speed up your system\'s performance. The FSB carries data between the CPU and RAM, and a faster front-side bus will deliver better overall performance.) The Core Solo processor delivers enhanced performance for today\'s demanding applications such as CAD tools, 3-D and 2-D modeling, video editing, digital music, digital photography and gaming. And Intel\'s Smart Cache technology enables smarter, more efficient cache and bus design for enhanced performance, responsiveness and power savings.</li>\r\n</ul>\r\n\r\n   ', null, null, null, null, null, null, null, null, null, null, '2 GB RAM', 'Sony VAIO VGN-TXN27N/B 11.1\" Notebook PC (Intel Core Solo Processor U1500, 2 GB RAM, 100 GB Hard Drive, DVD±RW Drive, Vista Business) Charcoal Black', 'Sony, VAIO, VGN-TXN27N/B , Notebook, PC, Intel, 2 GB RAM, Laptop', 'Sony VAIO VGN-TXN27N/B 11.1\" Notebook PC (Intel Core Solo Processor U1500, 2 GB RAM, 100 GB Hard Drive, DVD±RW Drive, Vista Business) Charcoal Black', '2699.9900', 'VGN-TXN27N/B', null, null, null, 'Sony VAIO VGN-TXN27N/B 11.1\" Notebook PC', null, null, null, '2699.9900', null, null, 'Intel Core Solo Processor U1500', null, null, '0', null, null, null, null, '9 inches', null, null, null, null, null, null, null, null, 'Take a load off your shoulders when you\'re racing for your plane with the sleekly designed and ultra-portable Sony Vaio VGN-TXN27N/B notebook PC.', 'VGN-TXN27N/B', null, '/s/o/sony-vaio-vgn-txn27n-b-11-1-notebook-pc.jpg', null, null, null, null, '2', '/s/o/sony-vaio-vgn-txn27n-b-11-1-notebook-pc.jpg', null, '2008-08-06 05:12:24', 'sony-vaio-vgn-txn27n-b-11-1-notebook-pc', null, '4', '2.8000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('28', '39', 'simple', null, '24', 'Black', '74', 'Toshiba', null, null, '899.9900', null, null, null, '2007-08-24 14:47:57', null, null, '', 'Easily mobile at just 6 pounds, the Toshiba Satellite A135-S4527 makes it easy to get your work done with a large, bright 15.4-inch widescreen LCD. The XGA-resolution screen (1280 x 800) permits side-by-side viewing of documents for increased productivity. It\'s also great for using as a media center, with Toshiba\'s unique Express Media Player enabling you to bypass the system and access CDs and DVDs with a touch of button. This affordable notebook PC is powered by Intel\'s 1.73 GHz Core Duo T2080 processor, which provides an optimized, multithreaded architecture for improved gaming and multitasking performance and efficient power consumption. It also offers a 120 GB hard drive, 1 GB of installed RAM (2 GB maximum), dual-layer/multi-format DVD drive that also burns CDs, integrated 54g wireless connectivity, and Intel GMA 950 video card with up to 256 MB of shared video RAM.\r\n\r\n', '17 x 7 x 13 inches', null, null, null, null, null, '0', null, '60 GB hard drive', '0', '/t/o/toshiba-m285-e-14.jpg', null, ' <ul>\r\n<ul class=\"disc\">\r\n<li>Processor: The Intel Core Duo T2080 processor is built with the Mobile Intel 945PM Express chipset, and it has a 1.73 GHz processor speed, fast 533 MHz front-side bus (FSB), and 1 MB L2 cache. (An L2, or secondary, cache temporarily stores data; and a larger L2 cache can help speed up your system\'s performance. The FSB carries data between the CPU and RAM, and a faster front-side bus will deliver better overall performance.)</li>\r\n</ul>', null, null, null, null, null, null, null, null, null, null, '1 GB RAM', 'Toshiba M285-E 14\" Convertible Notebook PC (Intel Core Duo Processor T2300E, 1 GB RAM, 60', 'Toshiba, notebook, laptop, intel, ', 'Toshiba Satellite A135-S4527 155.4\" Notebook PC (Intel Pentium Dual Core Processor T2080, 1 GB RAM, 120 GB Hard Drive, SuperMulti DVD Drive, Vista Premium)', '1599.9900', 'M285-E', null, null, null, 'Toshiba M285-E 14\"', null, null, null, '1599.9900', null, null, '1.66 GHz Intel Core Duo T2300E processor', null, null, '0', null, null, null, null, '14-inch screen ', null, null, null, null, null, null, null, null, 'Get the competitive edge with the Gateway M285-E. This widescreen Convertible Notebook functions as both a conventional notebook and a tablet.', 'M285-E', null, '/t/o/toshiba-m285-e-14.jpg', null, null, null, null, '2', '/t/o/toshiba-m285-e-14.jpg', null, '2008-08-08 14:51:44', 'toshiba-satellite-a135-s4527-155-4-notebook-pc-intel-pentium-dual-core-processor-t2080-1-gb-ram-120-gb-hard-drive-supermulti-dvd-drive-vista-premium', null, '4', '10.0000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('29', '40', 'simple', null, '25', 'Blue', null, null, null, null, '1.0000', null, null, null, '2007-08-24 18:53:19', null, null, '', 'Comfortable and fun to wear these clogs are the latest trend in fashion footwear. Wear them either at the beach, in your garden, at the mall or just about anywhere you would want to be comfortable.', null, null, null, null, '35', 'Womens', '0', null, null, '0', '/c/n/cn-clogs-beach-garden-clog-2.jpg', null, '    * Made of EVA foam\r\n    * Heel strap keeps shoe on foot\r\n    * Non-marking, slip-resistant outsole\r\n    * Weigh just 6-10 ounces\r\n\r\n', null, null, null, null, null, null, null, null, null, null, null, 'CN Clogs Beach/Garden Clog', 'CN Clogs Beach/Garden Clog ', 'CN Clogs Beach/Garden Clog', '15.9900', 'B000JI2N0I', null, null, null, 'CN Clogs Beach/Garden Clog', null, null, null, '15.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, '46', '3', '97', 'Sandal', 'Comfortable and fun to wear these clogs are the latest trend in fashion footwear', 'cn_3', null, '/c/n/cn-clogs-beach-garden-clog-3.jpg', null, null, null, null, '2', '/c/n/cn-clogs-beach-garden-clog-4.jpg', null, '2008-08-08 00:51:34', 'cn-clogs-beach-garden-clog-3', null, '1', '1.0000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('30', '40', 'simple', null, '61', 'Gray', null, null, null, null, '29.9900', null, null, null, '2007-08-24 19:00:49', null, null, '', 'The ASICS® GEL-Kayano® XII running shoe delivers the ultimate blend of cushioning and support. Biomorphic Fit™ upper offers enhanced upper fit and comfort while decreasing the potential for irritation. Solyte midsole material is lighter than standard EVA and SpEVA® combined with improved cushioning and durability. Impact Guidance System (I.G.S.®) uses linked componentry to encourage optimal gait while allowing for natural foot movement from heel strike to toe off. DuoMax® support system helps ensure that the shoe maintains proper support for the foot during the critical transition from heel strike to toe off. Space Trusstic® System creates a pocket between the Trusstic® System device and the midsole, allowing for greater midsole deformation and more efficient foot function. GEL® Cushioning System provides maximum rearfoot and forefoot shock attenuation. Wt. 12.6 oz.', null, null, null, null, '36', 'Mens', '0', null, null, '0', 'no_selection', null, '# I.G.S.?: Allows for natural foot movement from heel strike to toe-off\r\n# DuoMax? Support System: Maintains proper support for the foot during the critical transition from heel strike to toe-off\r\n# Space Trusstic System?: Allows for greater midsole deformation and more efficient foot function\r\n# GEL? Cushioning System: Provides maximum rearfoot/forefoot shock attenuation\r\n# Biomorphic Fit Upper: Provides enhanced upper fit and comfort while limiting irritation', null, null, null, null, null, null, null, null, null, null, null, 'ASICS® Men\'s GEL-Kayano® XII', 'ASICS® Men\'s GEL-Kayano® XII ', 'ASICS® Men\'s GEL-Kayano® XII', '134.9900', 'B000CP1M00', null, null, null, 'ASICS® Men\'s GEL-Kayano® XII', null, null, null, '134.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, '41', '8', '49', 'Running', 'The ASICS® GEL-Kayano® XII running shoe delivers the ultimate blend of cushioning and support. Biomorphic Fit™ upper offers enhanced upper fit and comfort while decreasing the potential for irritation. ', 'asc_8', null, 'no_selection', null, null, null, null, '2', 'no_selection', null, '2008-07-31 17:23:28', 'asics-men-s-gel-kayano-xii-8', null, '1', '3.0000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('31', '40', 'simple', null, '26', 'Red', null, null, null, null, '29.9900', null, null, null, '2007-08-24 19:05:50', null, null, '', 'Nothing will turn his head faster than you wearing the sexy Pryme pump from Steven by Steve Madden. This daring pump has a pretty patent leather upper with light shirring, a double stitch detail surrounding the collar, and a vampy almond shaped toe. It also features smooth linings, a fully cushioned insole, a sexy covered stiletto heel, and a lightly textured dress leather outsole. Any way you wear the Pryme, you\'re certain to catch a lot of attention.', null, null, null, null, '35', 'Womens', '0', null, null, '0', '/s/t/steven-by-steve-madden-pryme-pump-2.jpg', null, 'A prime example of chic style. Patent leather upper. Round toe. 3-1/2 inch covered heel. Flex leather sole. Imported. ', null, null, null, null, null, null, null, null, null, null, null, 'Steven by Steve Madden Pryme Pump', 'Steven by Steve Madden Pryme Pump', 'Steven by Steve Madden Pryme Pump', '69.9900', 'B000NOGIKY', null, null, null, 'Steven by Steve Madden Pryme Pump', null, null, null, '69.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, '45', '4', '51', 'High Heels', 'Nothing will turn his head faster than you wearing the sexy Pryme pump from Steven by Steve Madden. This daring pump has a pretty patent leather upper with light shirring, a double stitch detail surrounding the collar, and a vampy almond shaped toe', 'steve_4', null, '/s/t/steven-by-steve-madden-pryme-pump-3.jpg', null, null, null, null, '2', '/s/t/steven-by-steve-madden-pryme-pump-4.jpg', null, '2008-08-08 01:02:40', 'steven-by-steve-madden-pryme-pump-4', null, '1', '2.0000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('32', '40', 'simple', null, '26', 'Red', null, null, null, null, '29.9900', null, null, null, '2007-08-24 19:12:54', null, null, '', 'The Lucero pump from Nine West may just leave him at a loss for words. This flirty pump has a leather upper, a pretty almond-shaped toe with a slight V-cut vamp, leather linings, and a cushioned insole for long-wearing comfort. The stiletto heel radiates a subtle hint of sensuality, so sass up your jean and t-shirt look or nighttime attire with this hot pump and you\'ll be absolutely unforgettable.', null, null, null, null, '35', 'Womens', '0', null, null, '0', 'no_selection', null, 'The perfect pump will suit any ensemble. Leather upper. 3-3/4 inch stacked heel. Man-made sole. Imported. ', null, null, null, null, null, null, null, null, null, null, null, 'Nine West Women\'s Lucero Pump', 'Nine West Women\'s Lucero Pump ', 'Nine West Women\'s Lucero Pump', '89.9900', 'B000LJQVF8', null, null, null, 'Nine West Women\'s Lucero Pump', null, null, null, '89.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, '46', '3', '51', 'High Heels', 'The Lucero pump from Nine West may just leave him at a loss for words. This flirty pump has a leather upper, a pretty almond-shaped toe with a slight V-cut vamp', 'nine_3', null, 'no_selection', null, null, null, null, '2', 'no_selection', null, '2008-07-31 18:06:25', 'nine-west-women-s-lucero-pump-3', null, '1', '2.0000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('33', '40', 'simple', null, '59', 'Brown', null, null, null, null, '29.9900', null, null, null, '2007-08-24 19:21:42', null, null, '', 'Featuring a wide toe box and delivering optimum support, the sporty Golf Flexor golf shoe is a stylish cleat that you\'ll love wearing on and off the links. The contrasting embossed snakeskin panels attract interest, while the laid back lace-up style keeps things simple. And thanks to the one-year waterproof guarantee, you can trust these shoes to keep you in the game, even when conditions are less than perfect.', null, null, null, null, '35', 'Womens', '0', null, null, '0', '/e/c/ecco-womens-golf-flexor-golf-shoe-2.jpg', null, 'Featuring a wide toe box and delivering optimum support, the sporty Golf Flexor golf shoe is a stylish cleat that you\'ll love wearing on and off the links. The contrasting embossed snakeskin panels attract interest, while the laid back lace-up style keeps things simple. And thanks to the one-year waterproof guarantee, you can trust these shoes to keep you in the game, even when conditions are less than perfect.', null, null, null, null, null, null, null, null, null, null, null, 'ECCO Womens Golf Flexor Golf Shoe', 'ECCO Womens Golf Flexor Golf Shoe', 'ECCO Womens Golf Flexor Golf Shoe', '159.9900', 'B000NPOA1M', null, null, null, 'ECCO Womens Golf Flexor Golf Shoe', null, null, null, '159.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, '46', '3', '47', 'Golf Shoes', 'Featuring a wide toe box and delivering optimum support, the sporty Golf Flexor golf shoe is a stylish cleat that you\'ll love wearing on and off the links.', 'ecco_3', null, '/e/c/ecco-womens-golf-flexor-golf-shoe-3.jpg', null, null, null, null, '2', '/e/c/ecco-womens-golf-flexor-golf-shoe-4.jpg', null, '2008-08-08 01:04:49', 'ecco-womens-golf-flexor-golf-shoe-3', null, '1', '4.0000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('34', '40', 'simple', null, '24', 'Black', null, null, null, null, '29.9900', null, null, null, '2007-08-24 19:27:04', null, null, '', 'High fashion and classic good looks converge in this suave slip on from Kenneth Cole. Smooth leather upper in a dress slip on style, with a stitched and covered seam moc-inspired square toe, quarter panel curved overlays and flared tongue with side elastic panels for a comfortable, secure fit. Smooth leather lining, cushioned leather topped insole. Dress midsole with a beveled edge, 1 inch capped dress heel. Flat traction outsole.', null, null, null, null, '36', 'Mens', '0', null, null, '0', '/k/e/kenneth-cole-new-york-men-s-con-verge-slip-on-2.jpg', null, 'The handsome style of the Con-Verge slip-on from Kenneth Cole New York is larger than life. This sharp shoe has a semi-polished smooth leather upper, a squared off stitched apron toe, and dual-goring for easy on/off accessibility. It also features soft leather linings, a cushioned insole, and a paneled rubber outsole for a sturdy step. The Con-Verge is a perfect companion to your business and special occasion wardrobes.', null, null, null, null, null, null, null, null, null, null, null, 'Kenneth Cole New York Men\'s Con-verge Slip-on', 'Kenneth Cole New York Men\'s Con-verge Slip-on', 'Kenneth Cole New York Men\'s Con-verge Slip-on', '160.9900', 'B000IKC6AY', null, null, null, 'Kenneth Cole New York Men\'s Con-verge Slip-on', null, null, null, '160.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, '41', '8', '52', 'Dress', 'High fashion and classic good looks converge in this suave slip on from Kenneth Cole. Smooth leather upper in a dress slip on style, with a stitched and covered seam moc-inspired square toe, quarter panel curved overlays and flared tongue', 'ken_8', null, '/k/e/kenneth-cole-new-york-men-s-con-verge-slip-on-3.jpg', null, null, null, null, '2', '/k/e/kenneth-cole-new-york-