INSERT INTO `catalog_product_flat_1` VALUES ('93', '40', 'configurable', null, '61', 'Gray', null, null, null, null, '29.9900', null, null, null, '2007-08-29 11:46:47', null, null, '', 'Biomorphic Fit™ upper offers enhanced upper fit and comfort while decreasing the potential for irritation. Solyte midsole material is lighter than standard EVA and SpEVA® combined with improved cushioning and durability. Impact Guidance System (I.G.S.®) uses linked componentry to encourage optimal gait while allowing for natural foot movement from heel strike to toe off. DuoMax® support system helps ensure that the shoe maintains proper support for the foot during the critical transition from heel strike to toe off. Space Trusstic® System creates a pocket between the Trusstic® System device and the midsole, allowing for greater midsole deformation and more efficient foot function. GEL® Cushioning System provides maximum rearfoot and forefoot shock attenuation. Wt. 12.6 oz.', null, null, null, null, '36', 'Mens', '0', null, null, '1', '/a/s/asics-men-s-gel-kayano-xii-2.jpg', null, '<ul>\r\n<ul class=\"disc\">\r\n<li> I.G.S.: Allows for natural foot movement from heel strike to toe-off<br></li>\r\n<li>DuoMax Support System: Maintains proper support for the foot during the critical transition from heel strike to toe-off<br></li>\r\n<li> Space Trusstic System: Allows for greater midsole deformation and more efficient foot function<br></li>\r\n<li>GEL Cushioning System: Provides maximum rearfoot/forefoot shock attenuation<br></li>\r\n<li>Biomorphic Fit Upper: Provides enhanced upper fit and comfort while limiting irritation</li>\r\n\r\n</ul>', null, null, null, null, null, null, null, null, null, null, null, 'ASICS® Men\'s GEL-Kayano® XII', 'asics, gel, kayano', 'ASICS® Men\'s GEL-Kayano® XII', '134.9900', 'B000CP1M00', null, null, null, 'ASICS® Men\'s GEL-Kayano® XII', null, null, null, '134.9900', null, null, null, null, null, '1', null, null, null, null, null, null, null, null, null, null, null, '53', 'Tennis', 'The ASICS® GEL-Kayano® XII running shoe delivers the ultimate blend of cushioning and support. ', 'asc', null, '/a/s/asics-men-s-gel-kayano-xii-2.jpg', null, null, null, null, '2', '/a/s/asics-men-s-gel-kayano-xii-2.jpg', null, '2008-08-08 15:00:35', 'asics-men-s-gel-kayano-xii', null, '4', '3.0000', null);
