INSERT INTO `catalog_product_flat_1` VALUES ('135', '40', 'configurable', null, '59', 'Brown', null, null, null, null, '10.0000', null, null, null, '2007-08-30 11:22:53', null, null, '', 'Smooth kidskin upper in a dress platform wedge t-strap sandal style, with a round open toe, front and ankle adjustable buckles and tonal stitching accents. Ankle buckle features elastic panel. Smooth faux leather lining, cushioning faux leather and fabric topped insole. 1 inch matching leather and fabric wrapped midsole.', null, null, null, null, '35', 'Womens', '0', null, null, '1', '/a/n/anashria-womens-premier-leather-sandal.jpg', null, '<ul>\r\n<ul class=\"disc\">\r\n<li>Womens Style <br></li>\r\n<li>Genuine Top Grain Premier Leather <br></li>\r\n<li>Rich Color Tones <br></li>\r\n<li>Straps lined with 2000 lb test nylon <br></li>\r\n<li>Guaranteed for the Life of the Sole - Non-slip sole<br></li>\r\n</ul>', null, null, null, null, null, null, null, null, null, null, null, 'Anashria Womens Premier Leather Sandal', 'womens, sandal, leather, anashria, ', 'Anashria Womens Premier Leather Sandal', '41.9500', 'B000KJ43SG!', null, null, null, 'Anashria Womens Premier Leather Sandal', null, null, null, '41.9500', null, null, null, null, null, '1', null, null, null, null, null, null, null, null, null, null, null, '97', 'Sandal', 'Buckle embellished contrasting straps adorn both the heel and canvas covered wedge of this t-strap sandal to make it a truly unique addition to your wardrobe', 'ana', null, '/a/n/anashria-womens-premier-leather-sandal.jpg', null, null, null, null, '2', '/a/n/anashria-womens-premier-leather-sandal.jpg', null, '2008-08-08 15:06:02', 'anashria-womens-premier-leather-sandal', null, '4', '2.0000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('138', '9', 'simple', null, '24', 'Black', null, null, null, null, null, null, null, null, '2008-07-25 00:52:03', null, null, '', 'This superb, multi-functional Aspire X-Cruiser mid tower case is designed to follow Intel\'s recommendations to achieve the highest level of thermal performance. This gorgeous case outperforms most of the expensive chassis in the market, boasts an abundance of innovative features, yet carries a very affordable price tag. The Aspire X-Cruiser is fully loaded with everything you could possibly imagine that a great gaming case could have. With a built-in air duct on the side panel to funnel cool air towards the CPU, the fan-less X-Cruiser is specially designed to bring out the best performance in systems based on high-end processors.', null, null, null, null, null, null, '0', null, null, '0', '/a/p/apevia-black-x-cruiser-case-atx-mid-tower-case-default.jpg', null, null, null, null, null, null, null, null, null, null, null, null, null, '', '', '', null, null, null, null, null, 'Apevia Black X-Cruiser Case ATX Mid-Tower Case (Default)', null, null, null, '150.0000', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'This magnificent new case features 2 x 80mm built-in fans with space for 2 optional fans. The Aspire X-Cruiser features front temperature gauge, front fan speed controller and gauge, and front volume controller and gauge. It also features USB2.0, Firewire and audio ports. The superior cooling solution that X-Cruiser delivers can only be found in very few of the expensive chassis in the market.', 'apevia-black', null, '/a/p/apevia-black-x-cruiser-case-atx-mid-tower-case-default.jpg', null, null, null, null, '1', '/a/p/apevia-black-x-cruiser-case-atx-mid-tower-case-default.jpg', null, '2008-08-08 13:36:29', 'apevia-black-x-cruiser-case-atx-mid-tower-case', null, '4', '10.0000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('139', '9', 'simple', null, '23', 'Silver', null, null, null, null, null, null, null, null, '2008-07-25 00:54:41', null, null, '', 'Introducing the next advancement in case design and technology, the Lexa. Designed from ground up to be symmetrical, the Lexa is representative of the modern lifestyle design cues of today. The Lexa\'s minimalist and classy design fits perfectly under the NZXT Classic Series line.', null, null, null, null, null, null, '0', null, null, '0', '/n/z/nzxt-lexa-silver-aluminum-atx-mid-tower-case-default.jpg', null, null, null, null, null, null, null, null, null, null, null, null, null, '', '', '', null, null, null, null, null, 'NZXT Lexa Silver Aluminum ATX Mid-Tower Case (Default)', null, null, null, '199.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'The Lexa boasts a ridgid, but light weight aluminum chassis. The Lexa\'s high-air-flow design, while quiet, ensures cooling options for the more ambitious computing enthusiasts. Three thermal probes provide temperature readings to the illuminated LCD display for monitoring your systems core components. The Lexa ships with a rugged carrying strap with protective window cover for easy single-handed transportation.', 'nzxtlexa', null, '/n/z/nzxt-lexa-silver-aluminum-atx-mid-tower-case-default.jpg', null, null, null, null, '1', '/n/z/nzxt-lexa-silver-aluminum-atx-mid-tower-case-default.jpg', null, '2008-07-25 00:54:41', 'nzxt-lexa-silver-aluminum-atx-mid-tower-case', null, '4', '10.0000', null);
INSERT INTO `catalog_product_flat_1` VALUES ('140', '58', 'simple', null, null, null, null, null, null, null, null, null, null, null, '2008-07-25 00:59:55', null, null, '', 'Crucial 2GB PC4200 DDR2 533MHz Memory\r\nCrucial Technologies is part of Micron, the largest DRAM manufacturer in the U.S. and one of the largest in the world. Because they actually manufacture memory, they have unparalleled expertise in the upgrade industry. Crucial is the only consumer memory upgrade supplier that is part of a major DRAM manufacturer.\r\n\r\nEvery single Crucial memory module is tested before it goes out their doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality. ', null, null, null, null, null, null, '0', null, null, '0', '/c/r/crucial-2gb-pc4200-ddr2-533mhz-memory.jpg', null, null, null, null, null, null, '111', 'Crucial', null, null, null, null, null, '', '', '', null, null, null, null, null, 'Crucial 2GB PC4200 DDR2 533MHz Memory', null, null, null, '199.9900', null, null, null, '2GB', null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'Crucial 2GB PC4200 DDR2 533MHz Memory\r\nCrucial Technologies is part of Micron, the largest DRAM manufacturer in the U.S. and one of the largest in the world. Because they actually manufacture memory, they have unparalleled expertise in the upgrade industry. Crucial is the only consumer memory upgrade supplier that is part of a major DRAM manufacturer.\r\n\r\nEvery single Crucial memory module is tested before it goes out their doors. Crucial chips are individually tested under varying temperatures, voltages, and operational conditions for performance and functionality. ', '2gbdimm', null, '/c/r/crucial-2gb-pc4200-ddr2-533mhz-memory.jpg', null, null, null, null, '1', '/c/r/crucial-2gb-pc4200-ddr2-533mhz-memory.jpg', null, '2008-07-25 02:14:23', 'crucial-2gb-pc4200-ddr2-533mhz-memory', null, '4', '1.0000', null);
