INSERT INTO `catalog_product_flat_1` VALUES ('151', '60', 'simple', null, null, null, null, null, null, null, null, null, '112', '3.0 GHz', '2008-07-25 01:13:21', null, null, '', 'Intel® Core™2 Duo processor is the new brand name for our next-generation energy-efficient performance desktop and mobile processors. Formerly known by their codenames Conroe and Merom, the Intel® Core™2 processors for desktop and mobile computers are based on the Intel® Core™ microarchitecture, Intel\'s new industry-leading foundation for all mobile, desktop and server platforms moving forward.', null, null, null, null, null, null, '0', null, null, '0', '/i/n/intel-c2d-e8400-3-0ghz-retail.jpg', null, null, null, null, null, null, '116', 'Intel', null, null, null, null, null, '', '', '', null, null, null, null, null, 'Intel C2D E8400 3.0GHz Retail', null, null, null, '98.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'Intel® Core™2 Duo processor is the new brand name for our next-generation energy-efficient performance desktop and mobile processors.', 'intelc2d', null, '/i/n/intel-c2d-e8400-3-0ghz-retail.jpg', null, null, null, null, '1', '/i/n/intel-c2d-e8400-3-0ghz-retail.jpg', null, '2008-08-08 15:33:10', 'intel-c2d-e8400-3-0ghz-retail', null, '4', '1.0000', null);
