INSERT INTO `catalog_product_flat_2` VALUES ('112', '40', 'configurable', null, '59', 'Brown', null, null, null, null, '29.9900', null, null, null, '2007-08-29 13:17:43', null, null, '', 'Featuring a wide toe box and delivering optimum support, the sporty Golf Flexor golf shoe is a stylish cleat that you\'ll love wearing on and off the links. The contrasting embossed snakeskin panels attract interest, while the laid back lace-up style keeps things simple. And thanks to the one-year waterproof guarantee, you can trust these shoes to keep you in the game, even when conditions are less than perfect.', null, null, null, null, '35', 'Womens', '0', null, null, '1', '/e/c/ecco-womens-golf-flexor-golf-shoe.jpg', null, '<ul>\r\n<ul class=\"disc\">\r\n<li>Breathable mesh fabric lining<br></li>\r\n<li>Cushioned Comfort Fibre System(R) <br></li>\r\n<li>Moisture absorbent<br></li>\r\n<li>Anti-bacterial insole<br></li>\r\n</ul>', null, null, null, null, null, null, null, null, null, null, null, 'ECCO Womens Golf Flexor Golf Shoe', 'ECCO, Womens, Golf, Flexor, Shoe', 'ECCO Womens Golf Flexor Golf Shoe', '159.9900', 'B000NPOA1M', null, null, null, 'ECCO Womens Golf Flexor Golf Shoe', null, null, null, '159.9900', null, null, null, null, null, '1', null, null, null, null, null, null, null, null, null, null, null, '47', 'Golf Shoes', 'With a wide toe box and delivering optimum support, the sporty Golf Flexor golf shoe is a stylish cleat that you\'ll love wearing on and off the links.', 'ecco', null, '/e/c/ecco-womens-golf-flexor-golf-shoe.jpg', null, null, null, null, '2', '/e/c/ecco-womens-golf-flexor-golf-shoe.jpg', null, '2008-08-08 15:02:49', 'ecco-womens-golf-flexor-golf-shoe', null, '4', '4.0000', null);
