INSERT INTO `catalog_product_flat_2` VALUES ('145', '60', 'simple', null, null, null, null, null, null, null, null, null, '113', '2.5 GHz', '2008-07-25 01:07:37', null, null, '', 'Overclocker’s dream! Deliver more sophisticated solutions with the leading-edge technology of AMD Phenom™ 9000 Series processor. Built from the ground up for true quad-core performance, AMD Phenom 9000 Series processors incorporate a unified high-speed L3 cache and high-speed DDR2 memory. Speed through complex multitasking, critical business productivity, advanced visual design and modeling and visually stunning digital media and entertainment. Whether it\'s a single solution or an enterprise system, AMD Phenom processors have the power to perform.', null, null, null, null, null, null, '0', null, null, '0', '/a/m/amd-phenom-x4-9850-black-ed-2-50ghz-retail.jpg', null, null, null, null, null, null, '117', 'AMD', null, null, null, null, null, '', '', '', null, null, null, null, null, 'AMD Phenom X4 9850 Black Ed. 2.50GHz Retail', null, null, null, '335.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'Deliver more sophisticated solutions with the leading-edge technology of AMD Phenom™ 9000 Series processor.', 'amdphenom', null, '/a/m/amd-phenom-x4-9850-black-ed-2-50ghz-retail.jpg', null, null, null, null, '1', '/a/m/amd-phenom-x4-9850-black-ed-2-50ghz-retail.jpg', null, '2008-08-08 15:10:32', 'amd-phenom-x4-9850-black-ed-2-50ghz-retail', null, '4', '1.0000', null);
