INSERT INTO `catalog_product_flat_2` VALUES ('152', '61', 'simple', null, null, null, null, null, '106', '10000:1', null, null, null, null, '2008-07-25 01:14:11', null, null, '', 'With ultrafine 10,000:1 contrast and wide 170° viewing angles, this 24\" widescreen LCD monitor delivers crystal-clear high-definition visuals for gaming and work projects. The DVI-D input lets you connect a DVD player or other digital video device.\r\n\r\nProduct Features:\r\n    * Ultrafast 5 ms response time\r\n    * Digital Fine 10,000:1 contrast ratio; 400 cd/m² brightness\r\n    * 1920 x 1200 maximum resolution; wide 170° horizontal and vertical viewing angles\r\n', null, null, null, null, null, null, '0', null, null, '0', '/2/4/24-widescreen-flat-panel-lcd-monitor.jpg', null, null, null, null, null, null, '1', 'LG', '1920x1200', null, null, null, null, '', '', '', null, null, null, null, null, '24\" Widescreen Flat-Panel LCD Monitor', null, null, null, '699.9900', null, null, null, null, null, '0', '5ms', null, null, null, '24\"', null, null, null, null, null, null, null, null, '5 ms response time; 10,000:1 contrast ratio; 400 cd/m² brightness; 1920 x 1200 maximum resolution; DVI-D and 15-pin D-sub inputs', 'W2452T-TF', null, '/2/4/24-widescreen-flat-panel-lcd-monitor.jpg', null, null, null, null, '1', '/2/4/24-widescreen-flat-panel-lcd-monitor.jpg', null, '2008-08-08 15:33:00', '24-widescreen-flat-panel-lcd-monitor', null, '4', '1.0000', null);
INSERT INTO `catalog_product_flat_2` VALUES ('153', '60', 'simple', null, null, null, null, null, null, null, null, null, '114', '3.2 GHz', '2008-07-25 01:15:29', null, null, '', 'The new Intel® Core™2 Extreme processor QX9775 with hafnium-infused chip design delivers unrivaled gaming performance1 with four independent processing cores, 12 MB of cache, 1600 MHz Front Side Bus, and clock speeds of 3.2 GHz.The Intel® Core™2 Extreme processor is the world’s first quad core desktop processor, delivering the latest in cutting-edge processor technology and unprecedented performance across a wide range of applications and benchmarks. All Intel Core 2 Extreme processor QX9000 series are based on the industry-leading 45nm manufacturing technology, providing another giant leap forward on the road to multi-core and parallel computing.', null, null, null, null, null, null, '0', null, null, '0', '/i/n/intel-core-2-extreme-qx9775-3-20ghz-retail.jpg', null, null, null, null, null, null, '116', 'Intel', null, null, null, null, null, '', '', '', null, null, null, null, null, 'Intel Core 2 Extreme QX9775 3.20GHz Retail', null, null, null, '2049.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'Intel Core 2 Extreme QX9775 Processor BX80574QX9775 - 45nm, 3.20GHz, 12MB Cache, 1600MHz FSB, Yorkfield XE, Quad-Core, Retail, Socket 771, Processor', 'intelcore2extreme', null, '/i/n/intel-core-2-extreme-qx9775-3-20ghz-retail.jpg', null, null, null, null, '1', '/i/n/intel-core-2-extreme-qx9775-3-20ghz-retail.jpg', null, '2008-08-08 15:32:36', 'intel-core-2-extreme-qx9775-3-20ghz-retail', null, '4', '1.0000', null);
