INSERT INTO `catalog_product_flat_2` VALUES ('156', '61', 'simple', null, null, null, null, null, '106', '10000:1', null, null, null, null, '2008-07-25 01:16:51', null, null, '', 'Experience smooth gaming visuals and crystal-clear video with this 19\" flat-panel LCD monitor that features an ultrafast 2 ms response time and sharp 10,000:1 contrast. The DVI-D with HDCP input lets you connect a DVD player or other digital video device.\r\nProduct Features\r\n\r\n    * Ultrafast 2 ms response time\r\n    * Digital Fine 10,000:1 contrast ratio; 300 cd/m² brightness\r\n    * 1440 x 900 maximum resolution; wide 170° horizontal and vertical viewing angles\r\n', null, null, null, null, null, null, '0', null, null, '0', '/1/9/19-widescreen-flat-panel-lcd-monitor.jpg', null, null, null, null, null, null, '1', 'LG', '1440x900', null, null, null, null, '', '', '', null, null, null, null, null, '19\" Widescreen Flat-Panel LCD Monitor', null, null, null, '399.9900', null, null, null, null, null, '0', '2ms', null, null, null, '19\"', null, null, null, null, null, null, null, null, '2 ms response time; 10,000:1 contrast ratio; 300 cd/m² brightness; 1440 x 900 maximum resolution; DVI-D and 15-pin D-sub inputs', 'W1952TQ-TF', null, '/1/9/19-widescreen-flat-panel-lcd-monitor.jpg', null, null, null, null, '0', '/1/9/19-widescreen-flat-panel-lcd-monitor.jpg', null, '2008-08-08 15:33:26', '19-widescreen-flat-panel-lcd-monitor', null, '4', '1.0000', null);
INSERT INTO `catalog_product_flat_2` VALUES ('157', '61', 'simple', null, null, null, null, null, '107', '1500:1', null, null, null, null, '2008-07-25 01:19:30', null, null, '', '    * Digital (DVI), USB 2.0 and FireWire 400 inputs\r\n    * Cinema HD delivers up to 16.7 million colors across a wide gamut for a breathtaking, vivid picture\r\n    * ColorSync technology lets you create a custom profile to maintain consistent colors on the screen and in print\r\n    * Single cable with breakout for DVI, USB and FireWire ports provides a tidy look while reducing clutter\r\n    * Built-in, 2-port USB 2.0 hub to easily connect peripheral devices\r\n    * User controls allow you to monitor display power, system sleep/wake, brightness and monitor tilt\r\n    * Antiglare, hard-coat screen treatment\r\n    * Wall-mountable with optional mounting kit (not included)\r\n    * ENERGY STAR compliance assures a high standard of energy efficiency\r\n', null, null, null, null, null, null, '0', null, null, '0', '/3/0/30-flat-panel-tft-lcd-cinema-hd-monitor.jpg', null, null, null, null, null, null, '29', 'Apple', '1920x1200', null, null, null, null, '', '', '', null, null, null, null, null, '30\" Flat-Panel TFT-LCD Cinema HD Monitor', null, null, null, '699.9900', null, null, null, null, null, '0', '15ms', null, null, null, '30\"', null, null, null, null, null, null, null, null, 'Computer games, digital photo editing and graphic applications will astound you on this huge 30\" flat-panel monitor. Cinema HD and ColorSync technology let you enjoy 16.7 million breathtaking colors and custom profiling for color consistency.', 'M9179LL', null, '/3/0/30-flat-panel-tft-lcd-cinema-hd-monitor.jpg', null, null, null, null, '0', '/3/0/30-flat-panel-tft-lcd-cinema-hd-monitor.jpg', null, '2008-08-08 15:32:12', '30-flat-panel-tft-lcd-cinema-hd-monitor', null, '4', '1.0000', null);
INSERT INTO `catalog_product_flat_2` VALUES ('158', '39', 'bundle', null, null, null, null, null, null, null, null, null, null, null, '2008-07-25 01:21:23', null, null, '', ' <ul>\r\n<ul class=\"disc\">\r\n<li>Processor: The Ultra Low Voltage Intel Core Solo U1500 processor offers a 1.33 GHz speed paired with a fast 533 MHz front-side bus and large 2 MB L2 cache. (An L2, or secondary, cache temporarily stores data; and a larger L2 cache can help speed up your system\'s performance. The FSB carries data between the CPU and RAM, and a faster front-side bus will deliver better overall performance.) The Core Solo processor delivers enhanced performance for today\'s demanding applications such as CAD tools, 3-D and 2-D modeling, video editing, digital music, digital photography and gaming. And Intel\'s Smart Cache technology enables smarter, more efficient cache and bus design for enhanced performance, responsiveness and power savings.</li>\r\n</ul>\r\n', null, null, null, null, null, null, null, null, null, '1', '/s/o/sony-vaio-11-1-notebook-pc.jpg', null, null, null, null, null, null, null, null, null, null, null, null, null, 'Sony VAIO VGN-TXN27N/B 11.1\" Notebook PC (Intel Core Solo Processor U1500, 2 GB RAM, 100 GB Hard Drive, DVD±RW Drive, Vista Business) Charcoal Black', 'Sony, VAIO, VGN-TXN27N/B , Notebook, PC, Intel, 2 GB RAM, ', 'Sony VAIO VGN-TXN27N/B 11.1\" Notebook PC (Intel Core Solo Processor U1500, 2 GB RAM, 100 GB Hard Drive, DVD±RW Drive, Vista Business) Charcoal Black', null, null, null, null, null, 'Sony VAIO 11.1\" Notebook PC', null, null, null, null, '0', '1', null, null, null, '1', null, null, null, null, null, null, '0', null, null, null, null, null, null, 'Weighing in at just an amazing 2.84 pounds and offering a sleek, durable carbon-fiber case in charcoal black. And with 4 to 10 hours of standard battery life, it has the stamina to power you through your most demanding applications. With the integrated wireless WAN, you can access the national Sprint Mobile Broadband service to extend your wireless coverage beyond LAN access networks and hotspots, giving you the freedom to go farther, do more, and stay connected.\r\n\r\n', 'VGN-TXN27N/BW', '1', '/s/o/sony-vaio-11-1-notebook-pc.jpg', null, null, null, null, '0', '/s/o/sony-vaio-11-1-notebook-pc.jpg', null, '2008-07-25 02:05:56', 'sony-vaio-vgn-txn27n-b-11-1-notebook-pc', null, '4', null, '0');
INSERT INTO `catalog_product_flat_2` VALUES ('159', '9', 'simple', null, null, null, null, null, null, null, null, null, null, null, '2008-07-25 01:22:14', null, null, '', 'The most comfortable ergonomic keyboard on the market! We just made a great deal for this Microsoft Natural ergonomic keyboard. And we know you’re going to love it. This newest addition to the world’s best selling line of ergonomic keyboards features a natural wrist alignment that will make your day! Just one touch allows you to perform a wealth of common but important tasks such as opening documents and replying to e-mail. The Microsoft Natural Model 4000 ergonomic keyboard also features an improved number pad with easy-to-reach symbols such left and right, equal sign and back space placed just above the number pad. Easy-access to the Internet. Multimedia keys. Lockable F keys and much more (see complete list of additional features below). Don’t you think it’s time to go natural? Microsoft’s Natural Ergonomic Model 4000 Keyboard. Available right here, for the best price!', null, null, null, null, null, null, '0', null, null, '0', '/m/i/microsoft-natural-ergonomic-keyboard-4000.jpg', null, null, null, null, null, null, '120', 'Microsoft', null, null, null, null, null, '', '', '', null, null, null, null, null, 'Microsoft Natural Ergonomic Keyboard 4000', null, null, null, '99.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'The most comfortable ergonomic keyboard on the market! We just made a great deal for this Microsoft Natural ergonomic keyboard.', 'microsoftnatural', null, '/m/i/microsoft-natural-ergonomic-keyboard-4000.jpg', null, null, null, null, '0', '/m/i/microsoft-natural-ergonomic-keyboard-4000.jpg', null, '2008-08-08 15:31:54', 'microsoft-natural-ergonomic-keyboard-4000', null, '4', '1.0000', null);
INSERT INTO `catalog_product_flat_2` VALUES ('160', '9', 'simple', null, '59', 'Brown', null, null, null, null, null, null, null, null, '2008-07-25 01:24:15', null, null, '', 'Our most advanced trackball yet: a comfortable, cordless, finger-operated trackball that works where you need it. Save space and eliminate desktop clutter. Take advantage of extra buttons that help you navigate around Windows and the web more easily. And with Logitech\'s patented optical technology, you get virtually maintenance-free precision and smooth tracking.', null, null, null, null, null, null, '0', null, null, '0', '/l/o/logitech-cordless-optical-trackman.jpg', null, null, null, null, null, null, '121', 'Logitech', null, null, null, null, null, '', '', '', null, null, null, null, null, 'Logitech Cordless Optical Trackman', null, null, null, '79.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'Our most advanced trackball yet. It\'s comfortable, cordless, finger-operated and works where you need it. Save space and eliminate desktop clutter.', 'logitechcord', null, '/l/o/logitech-cordless-optical-trackman.jpg', null, null, null, null, '1', '/l/o/logitech-cordless-optical-trackman.jpg', null, '2008-08-08 15:31:33', 'microsoft-wireless-optical-mouse-5000', null, '4', '1.0000', null);
INSERT INTO `catalog_product_flat_2` VALUES ('161', '9', 'simple', null, null, null, null, null, null, null, null, null, null, null, '2008-07-25 01:25:09', null, null, '', 'PerfectStroke key system for the ultimate keyboard feel. Bluetooth wireless and Li-Ion powered. Stylishly sleek with its elegant charging base and backlit controls, the diNovo Edge makes a bold statement.\r\n\r\nAn ideal partner for any high-end computer, the ultra-slim Logitech diNovo Edge delivers the ultimate in feel and response. The revolutionary TouchDisc with hyper-speed scrolling and pixel-perfect control makes trackpads obsolete. A slim recharging base doubles as a keyboard stand. Work longer thanks to the longer-lasting Li-Ion batteries, and more securely via Bluetooth wireless technology. Combine it with the world\'s most advanced mouse, the Logitech MX Revolution, for a premium desktop experience!', null, null, null, null, null, null, '0', null, null, '0', '/l/o/logitech-dinovo-edge-keyboard.jpg', null, null, null, null, null, null, '121', 'Logitech', null, null, null, null, null, '', '', '', null, null, null, null, null, 'Logitech diNovo Edge Keyboard', null, null, null, '239.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'PerfectStroke key system for the ultimate keyboard feel. Bluetooth wireless and Li-Ion powered.', 'logidinovo', null, '/l/o/logitech-dinovo-edge-keyboard.jpg', null, null, null, null, '0', '/l/o/logitech-dinovo-edge-keyboard.jpg', null, '2008-08-08 15:31:22', 'logitech-dinovo-edge-keyboard', null, '4', '1.0000', null);
