INSERT INTO `catalog_product_flat_3` VALUES ('36', '41', 'simple', null, '60', 'White', null, null, null, null, '2.0000', null, null, null, '2007-08-24 19:53:06', null, null, '', 'We bought these with the intention of making shirts for our family reunion, only to come back the next day to find each and every one of them had been tagged by The Bear.  Oh well -- can\'t argue with art.  Now you can make your grandparents proud by wearing an original piece of graf work to YOUR family reunion!', null, null, null, null, '35', 'Womens', '0', null, null, '0', 'no_selection', null, null, null, null, null, null, null, null, null, null, null, null, null, 'Ink Eater: Krylon Bombear Destroyed Tee', 'Ink Eater: Krylon Bombear Destroyed Tee', 'Ink Eater: Krylon Bombear Destroyed Tee', '22.0000', 'Ink Eater:', null, null, null, 'Ink Eater: Krylon Bombear Destroyed Tee', null, null, null, '22.0000', null, null, null, null, null, '0', null, null, null, null, null, null, null, '100', 'Small', null, null, null, null, 'We bought these with the intention of making shirts for our family reunion, only to come back the next day to find each and every one of them had been tagged by The Bear.  Oh well -- can\'t argue with art.  Now you can make your grandparents proud by wearing an original piece of graf work to YOUR family reunion!', 'ink_sm', null, 'no_selection', null, null, null, null, '2', 'no_selection', null, '2008-08-08 00:49:48', 'ink-eater-krylon-bombear-destroyed-tee-sm', null, '1', '0.5000', null);
