INSERT INTO `catalog_product_flat_3` VALUES ('44', '44', 'simple', null, '24', 'Black', null, null, null, null, '200.0000', null, null, null, '2007-08-28 13:06:05', null, null, '', 'The Canon EOS Digital Rebel camera now has a new, faster, even smaller big brother. Sibling rivalries aside, the 8.0-megapixel Canon EOS Digital Rebel XT SLR adds resolution, speed, extra creative control, and enhanced comfort in the hand to one of the smallest and lightest digital cameras in its class. Even with its advancements in ergonomic design and technology, this easy-to-use EOS digital camera is compatible with all of Canon\'s EF lenses, including the EF-S lenses.', '5 x 3.7 x 2.5 inches', null, null, null, null, null, '0', null, null, '0', '/c/a/canon-digital-rebel-xt-8mp-digital-slr-camera-1.jpg', null, '<ul>\r\n<ul class=\"disc\"> \r\n\r\n<li>8.0-megapixel CMOS sensor captures enough detail for photo-quality 16 x 22-inch prints<br></li>\r\n<li>Includes Canon\'s EF-S 18-55mm, f3.5-5.6 zoom lens<br></li>\r\n<li>DIGIC II Image Processor provides fast, accurate image processing; captures images at a rate of up to 3 frames per second<br></li>\r\n<li>Fast start-up time--.2 seconds<br></li>\r\n<li>Powered by rechargeable Lithium-ion battery (included, with charger)</li>\r\n</ul>\r\n', null, null, null, null, null, null, null, null, '90', '8', null, 'Canon Digital Rebel XT 8MP Digital SLR Camera with EF-S 18-55mm f3.5-5.6 Lens (Black)', 'canon, slr, camera, 8, digital', 'Canon Digital Rebel XT 8MP Digital SLR Camera with EF-S 18-55mm f3.5-5.6 Lens (Black)', '449.0000', 'Rebel XT ', null, null, null, 'Canon Digital Rebel XT 8MP Digital SLR Camera', null, null, null, '550.0000', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, ' Canon EOS Digital Rebel XT SLR adds resolution, speed, extra creative control, and enhanced comfort in the hand to one of the smallest and lightest digital cameras in its class. ', 'Rebel XT', null, '/c/a/canon-digital-rebel-xt-8mp-digital-slr-camera-1.jpg', null, null, null, null, '2', '/c/a/canon-digital-rebel-xt-8mp-digital-slr-camera-1.jpg', null, '2008-06-24 22:50:46', 'canon-digital-rebel-xt-8mp-digital-slr-camera-with-ef-s-18-55mm-f3-5-5-6-lens-black', null, '4', '4.0000', null);
INSERT INTO `catalog_product_flat_3` VALUES ('45', '44', 'simple', null, '23', 'Silver', null, null, null, null, '20.0000', null, null, null, '2007-08-28 13:18:56', null, null, '', 'The Argus QC-2185 Quick Click 5MP digital camera offers all the basic features you need in a compact and stylish digital camera. This unit is easy to use, and is perfect for those who want a completely portable option for taking good pictures, without having to empty their wallet.\r\n\r\nThe Argus QC-2185 features a clear and bright 1.1-inch CSTN (color super-twist nematic) LCD display that makes it easy to frame the perfect picture. Thanks to its USB 1.1 connection compatibility, this digital camera lets you quickly download pictures to your Mac or PC, and can also function as a handy web camera. The QC-2185 includes eight megabytes of internal SDRAM memory, with the ability to expand camera memory via a built-in SD (secure digital) storage card slot for easy storage and transfer of your pictures. This unit also includes a built-in auto flash with a three to seven foot range, and comes with ArcSoft PhotoImpression\'s photo editing software which makes it easy for you to edit, crop, adjust and improve all your best pictures to make them even better.\r\n', '2.75 inches x 1.5 inches', null, null, null, null, null, '0', null, null, '0', '/a/r/argus-qc-2185-quick-click-5mp-digital-camera-2.jpg', null, '<ul>\r\n<ul class=\"disc\".  \r\n<li>5 megapixel digital camera with a 1600 x 1200 resolution and an f2.8 aperture</li>\r\n<li> Clear and bright 1.1-inch CSTN LCD display makes it easy to frame the perfect picture</li>\r\n<li>USB 1.1 connection compatibility lets you quickly download pictures to your Mac or PC, and function as a web camera</li>\r\n<li>Runs on 3 AAA batteries, and requires; Windows OS 98 or higher, at least 32 MB of RAM and 125 MB of hard disk space, and an available USB port</li>\r\n<li>Weighs 3.4 ounces, measures 3.6 x 2.4 x 1.1 inches (W x H x D), and is backed by a 1-year manufacturer\'s warranty</li>\r\n</ul>\r\n', null, null, null, null, null, null, null, null, '93', '5', null, 'Argus QC-2185 Quick Click 2MP Digital Camera', 'Argus, QC-2185, digital, camera, 2MP', 'Argus QC-2185 Quick Click 2MP Digital Camera', '37.4900', 'QC-2185', null, null, null, ' Argus QC-2185 Quick Click 5MP Digital Camera', null, null, null, '37.4900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'The Argus QC-2185 Quick Click 5MP digital camera offers all the basic features you need in a compact and stylish digital camera. This unit is easy to use, and is perfect for those who want a completely portable option for taking good pictures, without having to empty their wallet.', 'QC-2185', null, '/a/r/argus-qc-2185-quick-click-5mp-digital-camera-2.jpg', null, null, null, null, '2', '/a/r/argus-qc-2185-quick-click-5mp-digital-camera-2.jpg', null, '2008-08-08 14:52:48', 'argus-qc-2185-quick-click-5mp-digital-camera', null, '4', '1.0000', null);
INSERT INTO `catalog_product_flat_3` VALUES ('46', '44', 'simple', null, '23', 'Silver', null, null, null, null, '29.9900', null, null, null, '2007-08-28 13:23:34', null, null, '', 'Olympus continues to innovate with the launch of the Stylus 750 digital camera, a technically sophisticated point-and-shoot camera offering a number of pioneering technologies such as Dual Image Stabilization, Bright Capture Technology, and TruePic Turbo, as well as a powerful 5x optical zoom that tucks away into a streamlined metal, all-weather body design. The camera is distinguished by a number of premium features, including:\r\n\r\n    * An advanced combination of the mechanical CCD-shift Image Stabilization and Digital Image Stabilization work together to ensure the clearest pictures possible in any situation;\r\n    * A 5x optical zoom lens with a newly developed lens element to maintain a small compact size;\r\n    * A 2.5-inch LCD and Bright Capture Technology dramatically improve composition, capture and review of images in low-light situations;\r\n    * Olympus\' exclusive TruePic Turbo Image Processing engine is coupled with a 7.1-megapixel image sensor to produce crisp, high-quality p', '3.8 x 2.1 x 1 inches', null, null, null, null, null, '0', null, null, '0', '/o/l/olympus-stylus-750-7-1mp-digital-camera-2.jpg', null, '<ul>\r\n<ul class=\"disc\">\r\n\r\n<li>7.1-megapixel CCD captures enough detail for photo-quality 15 x 20-inch prints<br></li>\r\n<li>5x image-stabilized optical zoom; 2.5-inch LCD display<br></li>\r\n<li>Compact, all-weather body measures 3.8 x 2.1 x 0.96 inches<br></li>\r\n<li>Bright Capture technology; 27 selectable shooting modes; built-in Help guide<br></li>\r\n<li>Stores images on xD Picture Cards; powered by Li-Ion battery (battery and charger included)</li>\r\n</ul>', null, null, null, null, null, null, null, null, '91', '7', null, 'Olympus Stylus 750 7.1MP Digital Camera with Digital Image Stabilized 5x Optical Zoom and CCD Shift Stabilization (Silver)', 'Olympus, stylus, 750, 7MP, digital, camera, zoom', 'Olympus Stylus 750 7.1MP Digital Camera with Digital Image Stabilized 5x Optical Zoom and CCD Shift Stabilization (Silver)', '161.9400', '750', null, null, null, ' Olympus Stylus 750 7.1MP Digital Camera', null, null, null, '161.9400', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'A technically sophisticated point-and-shoot camera offering a number of pioneering technologies such as Dual Image Stabilization, Bright Capture Technology, and TruePic Turbo, as well as a powerful 5x optical zoom.', '750', null, '/o/l/olympus-stylus-750-7-1mp-digital-camera-2.jpg', null, null, null, null, '2', '/o/l/olympus-stylus-750-7-1mp-digital-camera-2.jpg', null, '2008-08-08 14:57:57', 'olympus-stylus-750-7-1mp-digital-camera', null, '4', '2.0000', null);
INSERT INTO `catalog_product_flat_3` VALUES ('47', '44', 'simple', null, '23', 'Silver', null, null, null, null, '29.9900', null, null, null, '2007-08-28 13:27:14', null, null, '', 'Replacing the highly popular PowerShot A620, the PowerShot A630 features a rotating 2.5-inch vari-angle LCD, 4x optical zoom lens, and a vast array of creative shooting modes.<br>\r\n\r\nThe PowerShot A630 packs a vast array of advanced features into a remarkably compact space<br><br>\r\n\r\n', '4.3 x 2.6 x 1.9 inches ', null, null, null, null, null, '0', null, null, '0', '/c/a/canon-powershot-a630-8mp-digital-camera-with-4x-optical-zoom-2.jpg', null, '<ul>\r\n<ul class=\"disc\">\r\n<li>8-megapixel CCD captures enough detail for photo-quality 16 x 22-inch prints<br></li>\r\n<li>4x optical zoom; 2.5-inch vari-angle LCD display<br></li>\r\n<li>ISO range up to ISO 800 for less blur in low light while hand-holding<br></li>\r\n<li>3:2 guide masks LCD to display 4 x 6-inch print size; 16:9 format option for still images<br></li>\r\n<li>Stores images on SD cards; powered by 4 AA-size batteries</li>\r\n</ul>', null, null, null, null, null, null, null, null, '90', '8', null, 'Canon PowerShot A630 8MP Digital Camera with 4x Optical Zoom', 'canon, powershot, A630, digital, camera, optical, zoom', 'Canon PowerShot A630 8MP Digital Camera with 4x Optical Zoom', '329.9900', 'A630 ', null, null, null, 'Canon PowerShot A630 8MP Digital Camera with 4x Optical Zoom', null, null, null, '329.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'Replacing the highly popular PowerShot A620, the PowerShot A630 features a rotating 2.5-inch vari-angle LCD, 4x optical zoom lens, and a vast array of creative shooting modes.', 'A630', null, '/c/a/canon-powershot-a630-8mp-digital-camera-with-4x-optical-zoom-2.jpg', null, null, null, null, '2', '/c/a/canon-powershot-a630-8mp-digital-camera-with-4x-optical-zoom-2.jpg', null, '2008-08-08 14:58:14', 'canon-powershot-a630-8mp-digital-camera-with-4x-optical-zoom', null, '4', '3.0000', null);
INSERT INTO `catalog_product_flat_3` VALUES ('48', '44', 'simple', null, '23', 'Silver', null, null, null, null, '29.9900', null, null, null, '2007-08-28 13:32:20', null, null, '', 'Small on size. Big on value. Kodak\'s newest C-Series digital camera, the C530, sports awesome features--such as 5.0-megapixel CCD resolution, on-camera image cropping, and an on-camera Share button--at a very affordable price.', ' 4 x 6 x 9 inches', null, null, null, null, null, '0', null, null, '0', '/k/o/kodak-easyshare-c530-5mp-digital-camera-2.jpg', null, '<ul>\r\n<ul class=\"disc\">   \r\n\r\n<li>5.0-megapixel CCD captures enough detail for photo-quality 13 x 17-inch prints<br></li>\r\n<li>1.5-inch LCD display<br></li>\r\n<li>Continuous QVGA video<br></li>\r\n<li>Auto scene mode and three color modes; in-camera cropping<br></li>\r\n<li>Powered by AA size batteries; stores images on SD memory cards (includes 16 MB internal memory)</li>\r\n</ul>', null, null, null, null, null, null, null, null, '93', '5', null, 'Kodak EasyShare C530 5MP Digital Camera', 'kodak, eayshare, c530, 5MP, digital, camera', 'Kodak EasyShare C530 5MP Digital Camera', '199.9900', 'C530 ', null, null, null, 'Kodak EasyShare C530 5MP Digital Camera', null, null, null, '199.9900', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'Small on size. Big on value. Kodak\'s newest C-Series digital camera, the C530, sports awesome features', 'C530', null, '/k/o/kodak-easyshare-c530-5mp-digital-camera-2.jpg', null, null, null, null, '2', '/k/o/kodak-easyshare-c530-5mp-digital-camera-2.jpg', null, '2008-08-08 14:58:41', 'kodak-easyshare-c530-5mp-digital-camera', null, '4', '2.0000', null);
