INSERT INTO `catalog_product_flat_3` VALUES ('98', '40', 'configurable', null, '24', 'Black', null, null, null, null, '29.9900', null, null, null, '2007-08-29 12:09:17', null, null, '', 'High fashion and classic good looks converge in this suave slip on from Kenneth Cole. Smooth leather upper in a dress slip on style, with a stitched and covered seam moc-inspired square toe, quarter panel curved overlays and flared tongue with side elastic panels for a comfortable, secure fit. Smooth leather lining, cushioned leather topped insole. Dress midsole with a beveled edge, 1 inch capped dress heel. Flat traction outsole.', null, null, null, null, '36', 'Mens', '0', null, null, '1', '/k/e/kenneth-cole-new-york-men-s-con-verge-slip-on.jpg', null, 'The handsome style of the Con-Verge slip-on from Kenneth Cole New York is larger than life. This sharp shoe has a semi-polished smooth leather upper, a squared off stitched apron toe, and dual-goring for easy on/off accessibility. It also features soft leather linings, a cushioned insole, and a paneled rubber outsole for a sturdy step. The Con-Verge is a perfect companion to your business and special occasion wardrobes.', null, null, null, null, null, null, null, null, null, null, null, 'Kenneth Cole New York Men\'s Con-verge Slip-on', 'Kenneth Cole, New York, Men\'s, Con-verge, Slip-on', 'Kenneth Cole New York Men\'s Con-verge Slip-on', '160.9900', 'B000IKC6AY', null, null, null, 'Kenneth Cole New York Men\'s Con-verge Slip-on', null, null, null, '160.9900', null, null, null, null, null, '1', null, null, null, null, null, null, null, null, null, null, null, '52', 'Dress', 'Smooth leather upper in a dress slip on style, with a stitched and covered seam moc-inspired square toe.', 'ken', null, '/k/e/kenneth-cole-new-york-men-s-con-verge-slip-on.jpg', null, null, null, null, '2', '/k/e/kenneth-cole-new-york-men-s-con-verge-slip-on.jpg', null, '2008-08-08 14:29:46', 'kenneth-cole-new-york-men-s-con-verge-slip-on', null, '4', '2.0000', 