INSERT INTO `catalog_product_flat_3` VALUES ('133', '9', 'simple', null, null, null, null, null, null, null, null, null, null, null, '2007-08-29 19:56:27', null, null, null, 'A stylish digital camera demands stylish protection. This leather carrying case will defend your camera from the dings and scratches of travel and everyday use while looking smart all the time.', null, null, null, null, null, null, '0', null, null, '0', '/u/n/universal-camera-case.jpg', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '34.0000', null, null, null, null, 'Universal Camera Case', null, null, null, '34.0000', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, 'A stylish digital camera demands stylish protection. This leather carrying case will defend your camera from the dings and scratches of travel and everyday use while looking smart all the time.', 'ac9003', null, '/u/n/universal-camera-case-1.jpg', null, null, null, null, '2', '/u/n/universal-camera-case-2.jpg', null, '2008-06-28 01:57:22', 'universal-camera-case', null, '4', null, null);
