INSERT INTO `review_detail` VALUES ('26', '26', '1', 'Great, affordable product', 'These tee shirts are generously cut, hold their color, stand up to repeated washings and are very comfortable. In addition, they are comfortable, extremely affordable and maintain their shape. I highly recommend them.', 'Patrick', '1');
INSERT INTO `review_detail` VALUES ('27', '27', '1', ' Well made, affordable. . .you can\'t go wrong!', 'I am very hard on my t-shirts, and therefore, I need the best quality t-shirt on the market. I\'ve tried them all (except Hanes).  Durable, strong, and surprisingly flattering to those of us lugging around a spare tire, if you get my drift.', 'Mike', '1');
