INSERT INTO `review_detail` VALUES ('37', '37', '1', 'Top leather scuffed on first wear', 'The shoes look and wear great. However, the leather is pretty weak. I think I must have kicked a table leg or something on my frist outing in them. Now the tip of my left shoe has a quarter-size scuff on it. I will have to try to cover it up by oiling it. Obviously I don\'t think this pair will last long at all.', 'Lian', '1');
