INSERT INTO `review_detail` VALUES ('43', '43', '1', ' Another stunning winner from the bright minds at Canon', 'I spent three hours yesterday playing with the brand-new Canon Digital Rebel XT digital SLR camera, and man, was I impressed.\r\n\r\nI hadn\'t been too impressed with the original Digital Rebel, except for its revolutionarily low price (for a d-SLR), because it was slow and felt slimsy. The new DR XT is quite different. Even though it\'s 3 ounces lighter than the original DR -- mostly due to the use of a smaller battery; see below -- its smaller form factor actually makes it feel more solid and \"real\". In other word, unlike the original DR, this one feels professional, not toy-like at all.\r\n\r\n\r\n', 'Mira', '1');
INSERT INTO `review_detail` VALUES ('44', '44', '1', ' The best thing I\'ve ever bought', 'The XT is amazing. The battery comes partly charged so you can immedietly start using the camera (thank you Canon!) I\'ve already shot about 200 pictures with it and the battery hasn\'t died yet.\r\n\r\n\r\n\r\n\r\n', 'Al', '1');
INSERT INTO `review_detail` VALUES ('45', '45', '1', 'great, comfy flip flops!', 'Very comfortable flip flops! I wear a size 10-11 and the \"extra-large\" was too small. Most stores don\'t carry the 10 or 11 (beyond extra-large) but I was able to find them on Amazon. Don\'t give up if you need a bigger size than the extra-large!', 'Erika', '1');
INSERT INTO `review_detail` VALUES ('46', '46', '1', 'These are the best sandals!', 'They were delivered really quickly and are just what I was expecting. The are great quality and so comfortable!', 'Jenna', '1');
