INSERT INTO `review_detail` VALUES ('49', '49', '1', 'great for everyday use', 'I purchased this camera a few months ago because I like to have a camera on hand always. My DSLR and 35 mm SLR cameras are too bulky for everyday. The price and MPs were right, as well as the small size which fits into the clean pockets of any of my purses- no need to worry about lens scratch. For those who don\'t carry a purse and are concerned about the lens, a very small case will do the trick. The images are clean although I\'ve only printed up to 8.5 X 11 so far.', 'Stull', '1');
INSERT INTO `review_detail` VALUES ('50', '50', '1', 'Amazing camera value!', 'This is one of those nice cameras that\'s so well done, it\'s easier to talk about what the camera ISN\'T, rather than what it IS! This camera is not a small, shirt pocket camera, and might be a bit bigger than a woman would wish to carry in a purse. It\'s not a super-tele camera, but it does have a respectable, bit longer than average 4x optical zoom. ', 'Juan', '1');
INSERT INTO `review_detail` VALUES ('51', '51', '1', 'Good Camera', '    	\r\n77 of 82 people found the following review helpful:\r\nGood Camera, October 11, 2006\r\nBy 	Steve (FL) - See all my reviews\r\nGot it yesterday. In green. Actually it\'s a shiney yellowish-green. Nice feel. Fits well in shirt pocket. Very light; particullarly compared to my Pentax Optio 550. Good, nice size LCD. Easy to use yet with nice availability of choices for customization. Well written manual (you can find online thru google) and onboard help menu. Photos come out fairly nice. Tried indoors in low light with several scene settings, outdoors, macro, and supermacro. Colors look true, fairly sharp without noticable artifact. Used in South Florida morning daylight outside without any trouble with LCD viewing (camera has no classic viewfinder). Have read reviews of washout in bright sun: have not tried that yet. Overall, I\'m happy with the camera thus far. ', 'Jenella', '1');
